4437=>["Value"=>4437,"TextKey"=>"道具描述1001","TextValue"=>"部落勇士的圖騰。合併獲得<color=#df66a8>部落頑皮寶寶</color>。"],
4438=>["Value"=>4438,"TextKey"=>"道具描述1006","TextValue"=>"高級部落勇士的圖騰。合併獲得<color=#df66a8>部落勇士</color>。"],
4439=>["Value"=>4439,"TextKey"=>"道具描述1101","TextValue"=>"南瓜精靈的圖騰。合併獲得<color=#df66a8>南瓜寶寶</color>。"],
4440=>["Value"=>4440,"TextKey"=>"道具描述1106","TextValue"=>"南瓜仙女的圖騰。合併獲得<color=#df66a8>仙女南瓜</color>。"],
4441=>["Value"=>4441,"TextKey"=>"道具描述1201","TextValue"=>"部落女性的圖騰。合併獲得<color=#df66a8>部落雛菊</color>。"],
4442=>["Value"=>4442,"TextKey"=>"道具描述1206","TextValue"=>"高級部落女性的圖騰。合併獲得<color=#df66a8>部落之花</color>。"],
4443=>["Value"=>4443,"TextKey"=>"道具描述1301","TextValue"=>"部落祭司的圖騰。合併獲得<color=#df66a8>部落神秘之子</color>。"],
4444=>["Value"=>4444,"TextKey"=>"道具描述1306","TextValue"=>"高級部落祭司的圖騰。合併獲得<color=#df66a8>部落祭司學徒</color>。"],
4445=>["Value"=>4445,"TextKey"=>"道具描述1401","TextValue"=>"部落戰士的圖騰。合併獲得<color=#df66a8>部落戰士學徒</color>。"],
4446=>["Value"=>4446,"TextKey"=>"道具描述1406","TextValue"=>"部落精英戰士的圖騰。合併獲得<color=#df66a8>部落戰士精英</color>。"],
4447=>["Value"=>4447,"TextKey"=>"道具描述1501","TextValue"=>"猛獁象的圖騰。合併獲得<color=#df66a8>猛獁幼崽</color>。象寶寶！"],
4448=>["Value"=>4448,"TextKey"=>"道具描述1506","TextValue"=>"高級猛獁象的圖騰。合併獲得<color=#df66a8>壯年猛獁象</color>。"],
4449=>["Value"=>4449,"TextKey"=>"道具描述1601","TextValue"=>"魔法貓咪的圖騰。逗你的！只是<color=#df66a8>鱷魚</color>而已。合併獲得<color=#df66a8>小鱷魚</color>."],
4450=>["Value"=>4450,"TextKey"=>"道具描述1606","TextValue"=>"巨鱷的圖騰。合併獲得<color=#df66a8>鱷魚戰士</color>。"],
4451=>["Value"=>4451,"TextKey"=>"道具描述1701","TextValue"=>"花精靈的圖騰。合併獲得<color=#df66a8>花精寶寶</color>。"],
4452=>["Value"=>4452,"TextKey"=>"道具描述1706","TextValue"=>"高級花精靈的圖騰。合併獲得<color=#df66a8>花姑娘</color>。"],
4453=>["Value"=>4453,"TextKey"=>"道具描述1801","TextValue"=>"巨人的圖騰。合併獲得<color=#df66a8>怪物幼崽</color>。"],
4454=>["Value"=>4454,"TextKey"=>"道具描述1806","TextValue"=>"獨眼巨人的圖騰。合併獲得<color=#df66a8>強壯獨眼巨人</color>。"],
4455=>["Value"=>4455,"TextKey"=>"道具描述1901","TextValue"=>"陸行鳥的圖騰。合併獲得<color=#df66a8>破殼陸行鳥</color>。"],
4456=>["Value"=>4456,"TextKey"=>"道具描述1906","TextValue"=>"大陸行鳥的高級圖騰。合併獲得<color=#df66a8>學徒陸行鳥</color>。"],
4457=>["Value"=>4457,"TextKey"=>"道具描述2001","TextValue"=>"石頭人的圖騰。合併獲得<color=#df66a8>初生石靈</color>。"],
4458=>["Value"=>4458,"TextKey"=>"道具描述2006","TextValue"=>"石頭人的高級圖騰。合併獲得<color=#df66a8>叢林巨石</color>。"],
4459=>["Value"=>4459,"TextKey"=>"道具描述2101","TextValue"=>"蝸牛的圖騰。合併獲得<color=#df66a8>西瓜蝸牛</color>。"],
4460=>["Value"=>4460,"TextKey"=>"道具描述2106","TextValue"=>"自然蝸牛的圖騰。合併獲得<color=#df66a8>葡萄蝸牛</color>。"],
4461=>["Value"=>4461,"TextKey"=>"道具描述2201","TextValue"=>"部落崇拜厲害的龍！合併獲得<color=#df66a8>大頭蜥蜴</color>。"],
4462=>["Value"=>4462,"TextKey"=>"道具描述2206","TextValue"=>"來自遙遠的過去。合併獲得<color=#df66a8>火焰龍</color>。"],
4463=>["Value"=>4463,"TextKey"=>"道具描述2301","TextValue"=>"一直有人想馴服劍齒虎。合併獲得<color=#df66a8>食肉獸幼崽</color>。"],
4464=>["Value"=>4464,"TextKey"=>"道具描述2306","TextValue"=>"亮出尖銳的獠牙。合併獲得<color=#df66a8>迅捷劍齒虎</color>。"],
4465=>["Value"=>4465,"TextKey"=>"道具描述18601","TextValue"=>"創世神的指示。"],
4466=>["Value"=>4466,"TextKey"=>"道具描述18701","TextValue"=>"破土而出的新生命。合併以產生更高級的<color=#38c0a5>竹子</color>。"],
4467=>["Value"=>4467,"TextKey"=>"道具描述18702","TextValue"=>"漸漸長大。合併以產生更高級的<color=#38c0a5>竹子</color>。"],
4468=>["Value"=>4468,"TextKey"=>"道具描述18703","TextValue"=>"長得和別人不太一樣，但同樣可愛。合併以產生更高級的<color=#38c0a5>竹子</color>。"],
4469=>["Value"=>4469,"TextKey"=>"道具描述18704","TextValue"=>"它也長大了！合併以產生更高級的<color=#38c0a5>竹子</color>。"],
4470=>["Value"=>4470,"TextKey"=>"道具描述18705","TextValue"=>"比它看起來的樣子還要更強壯！合併以產生更高級的<color=#38c0a5>竹子</color>。"],
4471=>["Value"=>4471,"TextKey"=>"道具描述18706","TextValue"=>"熊貓打得過這群竹子嗎？合併以產生更高級的<color=#38c0a5>竹子</color>。"],
4472=>["Value"=>4472,"TextKey"=>"道具描述18707","TextValue"=>"比熊貓的肚子還要粗壯！合併以產生更高級的<color=#38c0a5>竹子</color>。"],
4473=>["Value"=>4473,"TextKey"=>"道具描述18708","TextValue"=>"不知道它們小時候有沒有想到自己會長得這麼大。合併以產生更高級的<color=#38c0a5>竹子</color>。"],
4474=>["Value"=>4474,"TextKey"=>"道具描述18709","TextValue"=>"你會在這片綠色中迷路！合併以產生更高級的<color=#38c0a5>竹子</color>。"],
4475=>["Value"=>4475,"TextKey"=>"道具描述18710","TextValue"=>"一個美麗而安靜的角落。合併以產生更高級的<color=#38c0a5>竹子</color>。"],
4476=>["Value"=>4476,"TextKey"=>"道具描述18711","TextValue"=>"不禁感歎自然和生命之美。活動物品。"],
4477=>["Value"=>4477,"TextKey"=>"道具描述18801","TextValue"=>"合併為更高等級的<color=#38c0a5>蓮花</color>。沒有根的好運！"],
4478=>["Value"=>4478,"TextKey"=>"道具描述18802","TextValue"=>"合併為更高等級的<color=#38c0a5>蓮花</color>。它好小！"],
4479=>["Value"=>4479,"TextKey"=>"道具描述18803","TextValue"=>"合併為更高等級的<color=#38c0a5>蓮花</color>。它剛剛來到這個世界。"],
