11385=>["Value"=>11385,"TextKey"=>"图鉴描述10502","TextValue"=>"被公認為當代最偉大的巫師之一，他是個獨具天賦、仁慈、溫和、擁有洞察力的人，經常以一隻兔子的姿態示人，很少有人見過他真面目。"],
11386=>["Value"=>11386,"TextKey"=>"图鉴描述10503","TextValue"=>"部落中最擅長創作和吟詠英雄業績的詩人和歌手。遊走在世界各地中，行蹤不定，憑著自己的超凡智慧，將許多新奇的故事傳唱於世。"],
11387=>["Value"=>11387,"TextKey"=>"图鉴描述10504","TextValue"=>"天真活潑，對外面的世界充滿了好奇之心，喜歡敲敲打打，隨便拿起什麼都能來上一曲。"],
11388=>["Value"=>11388,"TextKey"=>"图鉴描述10505","TextValue"=>"曾經和部落一同失去了家園的獅子國王，擁有者人類行走的能力，強壯、聰明、勇敢，是一個真正的領袖。"],
11389=>["Value"=>11389,"TextKey"=>"图鉴描述10506","TextValue"=>"有著讓聞者落淚的心酸往事，但磨難不但讓她變得更強大，她還學會了一種讓火光中幻影成真的神秘魔法。"],
11390=>["Value"=>11390,"TextKey"=>"图鉴描述10507","TextValue"=>"一個有點吝嗇的頑皮鬼。曾因捉弄巫婆而被詛咒失去了原本的身體。但成為南瓜頭的他變得樂於助人，經常手舉燈籠為路人在黑暗中照明。"],
