12681=>["Value"=>12681,"TextKey"=>"新手引导说明1012","TextValue"=>"<color=#38aec0><color=#f58c26>家園</color></color>已解鎖，去看看吧！"],
12682=>["Value"=>12682,"TextKey"=>"新手引导说明2000","TextValue"=>"路過的好心人，救救我！"],
12683=>["Value"=>12683,"TextKey"=>"新手引导说明2001","TextValue"=>"我被封印在這些<color=#38c0a5>圖騰</color>中了！"],
12684=>["Value"=>12684,"TextKey"=>"新手引导说明2002","TextValue"=>"拖動任意<color=#38c0a5>圖騰</color>，使3個<color=#38c0a5>圖騰</color>彼此相鄰，它們就會自動合成，就可以解除封印啦！"],
12685=>["Value"=>12685,"TextKey"=>"新手引导说明2010","TextValue"=>"啊！這裡沒有<color=#38c0a5>圖騰</color>。"],
12686=>["Value"=>12686,"TextKey"=>"新手引导说明2011","TextValue"=>"看！是<color=#f58c26>創世神法典</color>，在各個關卡中都會看到它，其中的記錄一定可以幫到你。"],
12687=>["Value"=>12687,"TextKey"=>"新手引导说明2012","TextValue"=>"點擊它，可以查看遊戲的相關說明，試試看吧！"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2020","TextValue"=>"想要獲得關卡的勝利，需要按要求獲得指定的物品。"],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2022","TextValue"=>"在關卡目標中，會顯示你需要獲得的物品。開始合成，贏得勝利吧！"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"哇！<color=#ef933d>創世少女雕像</color>！她們的力量也消退了！需要通過合併喚醒她！"],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"在有<color=#ef933d>創世少女雕像</color>的關卡，一般都可以通過合併她們來獲得勝利。"],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2032","TextValue"=>"這片土地失去了與<color=#f58c26>創世女神</color>的聯繫，陷入了沉睡。"],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2033","TextValue"=>"你無法移動在<color=#38aec0>沉睡之地</color>上的任何東西！"],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2034","TextValue"=>"合併任意的<color=#38c0a5>靈花</color>來喚醒土地。"],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2035","TextValue"=>"關卡勝利後，<color=#f58c26>創世女神</color>會喚醒所有被巫師詛咒的土地！"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2040","TextValue"=>"看！是<color=#38c0a5>圖騰</color>！"],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2041","TextValue"=>"趕快合併3個<color=#38c0a5>圖騰</color>來解救族員吧！"],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"剛才我們說過，點擊大地<color=#38c0a5>靈球</color>可以喚醒土地。"],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2051","TextValue"=>"當然你也可以通過合併獲得更高等級的大地<color=#38c0a5>靈球</color>。"],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2060","TextValue"=>"可以合併普通和<color=#38aec0>沉睡之地</color>上的相同道具，<color=#38aec0>沉睡之地</color>將自動被喚醒。"],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2070","TextValue"=>"點擊<color=#38c0a5>圖騰</color>堆來獲得'<color=#38c0a5>圖騰</color>'。"],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"某些<color=#38aec0>超級沉睡之地<color=#38aec0>，無法被<color=#38aec0>治癒值</color>喚醒，只能通過與普通土地上的道具合併的方式來喚醒。"],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"從現在開始，關卡帶有任務了。"],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2091","TextValue"=>"您可以點擊任務太陽來查看內容和獎勵。"],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"這個鍵可鎖定或解鎖螢幕拖動。"],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"某些道具無法直接被合併，您可點擊<color=#ef933d>楔形石堆</color>使其變為<color=#ef933d>楔形石</color>，再進行合併。"],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"您需要查看這個關卡的通關目標。"],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"我們可以從各種<color=#38c0a5>龍骨</color>中，獲得<color=#ef933d>灌木綠芽</color>。"],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"這是一個超大型<color=#ef933d>喚醒炸彈</color>，如果你喚醒它相鄰的土地，它就會自我喚醒。它自我喚醒時，會同時喚醒它四周1格的土地。"],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"部落成員可以從更高級的<color=#38c0a5>藤蔓</color>處採集到<color=#38c0a5>原石礦</color>，您可以點擊來收集。"],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"這是一個<color=#ef933d>破碎墓碑</color>。如果放任它們不管或合併，它們會變化為恐怖的僵屍。擊殺僵屍後，會獲得<color=#38c0a5>螢火蟲</color>道具，也就是通過本關必需的道具。"],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"<color=#ef933d>荒廢的壁巢</color>會持續不斷地產生僵屍，無論其是否處於喚醒狀態。點擊它會立即產生一隻僵屍。破壞<color=#ef933d>荒廢的壁巢</color>之後，會獲得大量的原石礦獎勵。"],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"這是一個<color=#ef933d>德魯伊符文陣</color>，運氣真好！合併它們，可以從營地裡隨機召喚一個<color=#38c0a5>部落成員<color=#38c0a5>來幫忙。"],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"創世神樹遺留的聖物，它們可以自動生成<color=#38c0a5>大地靈球</color>喚醒土地。創世神樹遺留的聖物等級越高，治癒能力越強。"],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>"這裡會不斷出現<color=#ef933d>荒野雲朵</color>，點擊它們，使它們持續下雨。下雨範圍內的空白土地，會持續產生<color=#38c0a5>水坑</color>和<color=#38c0a5>靈花</color>。"],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"奇怪，<color=#ef933d>創世少女像</color>去哪裡了？"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"哦對了，如果你完成任務，她們就會出現！"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"這是<color=#ef933d>魔神雕像</color>，醜陋的東西！命令你的部落成員消滅它，會獲得<color=#ef933d>創世少女像</color>。"],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"有新的營地被開啟，快去<color=#f58c26>世界地圖</color>裡看一下吧"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"我重獲自由啦，謝謝。"],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"我們的族員都被禁錮在這些<color=#38c0a5>圖騰</color>中了。"],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"我們的部落需要您來拯救，要尋找其他被禁錮的族員。"],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"去下一個關卡中找找吧！"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"可以通過按兩下某些物品或拖動族員到物品上讓他們進行採集。"],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"採集的物品可供你使用或合併。"],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"採集<color=#38c0a5>靈花</color>可以獲得<color=#38c0a5>靈球</color>。"],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"點擊<color=#38c0a5>靈球</color>可以喚醒沉睡的土地。"],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"從現在開始，關卡結束時可以選擇獎勵了。"],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"獎勵通常都是金幣和其他有用的東西。有時候甚至是一個<color=#38c0a5>圖騰</color>。"],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"你的獎勵會被裝進<color=#38aec0>大地泡泡</color>中，送回到<color=#f58c26>家園</color>中了。"],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"這就是我們的<color=#f58c26>家園</color>。"],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"我們的部落曾經生活在這裡，但那場大洪水毀壞了我們的<color=#f58c26>家園</color>，迷霧遮蓋了這片土地，我們不得不背井離鄉。"],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"將道具與<color=#38aec0>沉睡之地</color>上的道具合併可以直接喚醒該地塊。嘗試合併解封族員吧，就能驅除越多的迷霧。"],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"至多開啟一個<color=#38c0a5>時間寶箱</color>，待倒計時結束可以獲得獎勵。也可花費<color=#38c0a5>寶石</color>直接打開任何<color=#38c0a5>時間寶箱</color>。"],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"關卡中的獎勵已經發送到了這裡，打開泡泡看看吧。"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<color=#38c0a5>長屋</color>是部落成員休息的場所，一段時間後部落成員可重新活動。"],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"<color=#38c0a5>長屋</color>可以合併為更高級的長屋，長屋等級越高，對應所需的休息時間越短。"],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"可以花費<color=#38c0a5>寶石</color>立即喚醒他們。"],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"可完成<color=#f58c26>家園</color>任務來獲得更多的<color=#38c0a5>大地遺產</color>，點擊<color=#38c0a5>大地遺產</color>，可獲得特殊戰利品。"],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"這是一枚小<color=#38c0a5>金礦</color>。"],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"您可以點擊它們獲得金幣資源，也可以合併更高級的<color=#38c0a5>金礦</color>。"],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<color=#38c0a5>金礦</color>資源可以在<color=#f58c26>商店</color>中花費"],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<color=#38c0a5>金礦</color>滿了？你可以去<color=#f58c26>商店</color>買點好東西！"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"所有的<color=#df66a8>部落成員</color>都沒力氣了，需要休息一段時間。"],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"現在趕緊去挑戰更多關卡解救更多族員吧！"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"你擁有的族員越多，在他們休息前，能為你採集到的東西就越多！"],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"可以通過贏得關卡的勝利來解救更多的族員，"],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"然後就可以帶領他們回家！"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"看！從這裡可以通過<color=#f58c26>世界地圖</color>前往關卡！"],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"沒地方放啦！地上已經鋪滿啦！"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"選中一個道具，然後在資訊區域選擇出售或者銷毀。"],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"這是一個<color=#38c0a5>異星遺產</color>，它非常稀有！點擊它可獲得<color=#38c0a5>寶石</color>，也可以合併它們，獲得更高等級的'異星遺產'。"],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"這是一塊<color=#38c0a5>原石</color>礦渣。"],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"您可以點擊它們獲得<color=#38c0a5>原石</color>資源，也可以合併為更高級的原石礦。"],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<color=#38c0a5>原石</color>資源可以在<color=#f58c26>商店</color>中花費。"],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"如果<color=#38c0a5>原石</color>已滿，可通過<color=#f58c26>商店</color>購買來花費掉。"],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"這是可惡的<color=#38c0a5>路障</color>，平時是無法移動的。可以命令<color=#df66a8>部落成員</color>去攻擊，或者按兩下<color=#38c0a5>路障</color>。擊碎<color=#38c0a5>路障</color>後，可能產生較小的<color=#38c0a5>路障</color>。"],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"未被喚醒的<color=#38c0a5>炮臺</color>也能攻擊並污染周圍的土地。進度條表示開炮間隔。但喚醒它才能攻擊它！"],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"這是<color=#f58c26>英雄祭壇</color>。英雄會在休息和巡邏狀態下切換。"],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"英雄在時，任意4合會有額外驚喜！"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"若處於休息狀態下，可以花費<color=#38c0a5>寶石</color>將其直接喚醒。"],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"您可以點擊這裡，查看英雄相關資訊"],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"英雄作為部落的強力單位，擁有獨特的技能。"],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"英雄技能，該區域可查看英雄技能的描述。"],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"可提交使命來提升英雄等級。"],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"完成全部訂單內容即可使英雄升級"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"幹得漂亮，有更多的族員解除了封印！"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"部落的人口越多，就可以清除更多的迷霧！"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"每一個區域的迷霧都需要一定程度的<color=#f58c26>部落之力</color>才可以驅除。"],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"現在已有一塊迷霧可以點擊清除了。"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"當前迷霧不可驅除"],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"您的<color=#f58c26>部落之力</color>不足，可以去<color=#f58c26>商店</color>購買更多的<color=#38c0a5>圖騰</color>"],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"可花費金幣購買<color=#38c0a5>圖騰</color>"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"每次購買後<color=#38c0a5>圖騰</color>都會漲價，快去收集更多的金幣吧"],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"這是一個<color=#f58c26>限時關卡</color>，必須在有限時間內完成，否則會失敗"],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"以下區域記錄著關卡剩餘時間"],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"隨時間減少，數字顏色由<color=#46bb83>綠色</color>變為<color=#eca852>黃色</color>， <color=#e04030>紅色</color>"],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"為了提高通關效率，可以看一下<color=#f58c26>商店</color>"],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"可以直接花費<color=#38c0a5>寶石</color>，在<color=#f58c26>商店</color>中直接購買關鍵道具"],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"此類關卡勝利可獲得<color=#df66a8>部落成員</color>作為獎勵，您可以花費<color=#38c0a5>寶石</color>，使獎勵翻倍"],
