13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"早上好呀，酋長！我是特裡斯坦，您忠誠的偵察兵！旅途艱險，但我們都活下來了，真是太好啦！終於找到陸地了，現在我們可以建個<color=#f58c26>營地</color>了。"],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"這真是鬱鬱蔥蔥！不知道我們在這兒會碰見什麼呢？我們先來搭個帳篷為我們遮風擋雨吧！"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"我的神啊，這都是啥啊……這貧瘠的醜陋土地……還有這個醜陋的帳篷！我好想家……"],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"恩達，我知道對於你來說，離開家不是件簡單事，但是除此之外別無他法。那些自然災害實在是太奇怪了……我們必須得找到解釋！這就是我們要出來尋求幫助的原因。"],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"但是我們會找到回家的方法的，好嗎？我們先給你建一個<color=#f58c26>祭壇</color>好讓你跟神聊聊天，怎麼樣，祭司恩達？酋長會幫忙的！"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"看看我們找到了什麼！<color=#ef933d>大地遺產</color>！這樣我們建造<color=#f58c26>祭壇</color>所需的材料就全準備好了。我們還找到了解開圖騰封印的方法！這地方是個福地啊！"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"我猜你也不是個完全的廢物……叫什麼，斯坦，的傢伙。雖然這個祭壇比我家裡那個小多了，一點也不氣勢恢宏，但是現在是夠用了。現在，到一邊去！"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"啊呀~真可愛~看她多高興啊！還有她那非常扭曲的道謝的方式！"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"（跳了一支奇怪的舞）我們的神對我說，我們所在之處是正確的，接著我們會遇見一位貴人……"],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"真的嗎？那真是驚天好消息！我們什麼時候能遇見這位貴人呢？"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"是你們這些頑徒將我從睡夢中驚醒了嗎？！"],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"……您是？"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"我是大德魯伊、吟游詩人之祖、風暴的征服者、冒險者的守護神、神的行刑官兼信使、公正的大法官，歌唱的阿梅金！"],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"額……很高興認識你，我猜？我們是新來的，然後我們剛剛聽說……"],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"什麼？！你們是外來侵略者？！我不會給你們毀壞家園、破壞家庭的機會！"],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"什麼？不，不是！我們不是侵略者！我們只是在找地方歇腳，順便解決一下我們家園的謎團……"],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"不！橋！看你幹的好事！神會發怒的！等等……你說你是誰？阿梅金？大德魯伊阿梅金？傳說裡的那個？"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"你們……不是侵略者？那你們是誰？你們在這裡做什麼？等等……我在這裡做什麼？這是哪兒？我的人民呢？我對這裡毫無印象……"],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"對不起，但是我們也回答不了你這些問題。我們冒著生命危險遠道而來，為了尋找能幫我們解決家園謎團的能手。一團濃重的迷霧籠罩著我們的家園，接著……"],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"去年一年發過的洪水比過去十年的都多。但是最奇怪的是，我們的族員一個個都變成了沒有生命的圖騰！你能信嗎？！"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"噢……這信息量有點大。對不起我剛才過於魯莽了，毀了你們的橋。也許我能幫你們把它重新建起來？"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"阿梅金？！偉大的阿梅金？！你的長袍、你能呼風喚雨的能力……你是真的！那就是說我家族的藏書裡所有的傳說都是真的！"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"工人們，振作起來重建那座橋！"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"但是我們受傷了！我們現在沒法幹活！"],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"我知道你們需要什麼。在我漫長的旅行生涯中我學到了很多關於草藥的知識。我們收集一些藥草，然後在這裡建一個<color=#f58c26>藥草園</color>。就當做我向你們道歉了。"],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"謝謝！你真厚道。我們一會兒會用我們新學到的知識回家園解救那些困在圖騰中的人民！太好了，出發！"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"我們回來了，我們還帶了新幫手！來把這座<color=#f58c26>小藥草園</color>建起來吧！"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"哇，不得不說你的建造技術還真不錯！這個小花園真漂亮。"],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"而且很有用！現在工人們的傷都治好了，我們馬上就可以重建那座橋了！"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"很高興能幫忙。"],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"說起來，祭司剛才還在誇獎您的美德和淵博的學識。我其實是在說……"],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"像您這樣經驗豐富的冒險家能加入我們，會是我們莫大的榮幸。但是您是一個傳奇！您不可能隨隨便便地就跟一些奇怪的陌生人走了！您可能嗎？求求您了，和我們一起走吧！"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"好啊。也許這就是我被派來這裡的原因。"],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"我就知道，您不會願意……什麼！您要和我們來？！天哪，難以置信……今天是我這輩子最棒的一天！"],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"對不起，她有時候會比較激動。現在既然您加入了我們的隊伍，我們何不為您舉行一場歡迎派對呢？"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"不必了，沒有派對我也挺好的。現在我手上有更緊要的事情要做。我要找些木頭來，把那座我毀掉的橋重新建起來。"],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"多麼高尚的人啊！噢！光是得以與他見面……這就是我生命中最棒的一天！"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"你是……酋長，對吧？剛才你幫了我大忙了，謝謝。現在我們準備好要建橋了。"],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"就像新的一樣！現在，祭司恩達，你準備好和神再聊次天了嗎？"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"從來沒準備得這麼好過！"],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"好的，酋長，現在祭司和她親愛的祭壇重逢了，我們可以幹點活……"],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"唉喲！什麼東西絆了我？哈，一塊從<color=#f58c26>祭壇</color>上掉下來的<color=#38c0a5>原石</color>。你們這些人幹活真不小心。"],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"啊哈！我知道了！我們需要建一個用來儲存各種資源的<color=#f58c26>倉庫</color>。這樣大家就不會被地上散落的各種東西絆倒了。"],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"東西都準備好了嗎？我們來狂歡吧！抱歉，我是說，建<color=#f58c26>倉庫</color>。"],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"堅實的牆壁，寬闊而明亮的室內空間……酋長的建造技能日益精進呀！"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"啊，長官？你身後有一個八條腿的東西。"],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"什麼？！怎麼會？！這是什麼東西？！它看起來像是某種水生動物的屍體……嗯，它的皮膚又滑又富有彈性。"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<color=#f58c26>北海巨妖</color>！它是<color=#f58c26>北海巨妖</color>！！我在書裡讀到過，這一定是那種怪物的幼崽！為什麼這兒會有一隻<color=#f58c26>北海巨妖</color>？！"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"不用害怕，首先它肯定是死了，其次這只是一隻<color=#f58c26>章魚</color>而已。"],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"章魚？從來沒聽說過……"],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"那麼你們一定是從內陸來的。我的民族是一個航海的民族。我們以海為生。章魚對我們來說就如夜空中的星星一般普遍。"],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"其實，跟我來，我們來找些繩子和樹枝。讓你們看看怎麼用章魚皮搭個帳篷。"],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"……然後……就，搭好了。我想像中的它沒這麼醜。"],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"它真……真……可愛！"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"對不起，比起實際操作來，我還是更擅長理論。建造……並不是我擅長的。現在……我可能需要躺一會兒……"],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"噢偉大的阿梅金！您為何不隨我到我們的主帳篷去休息一下呢？您向我傳授了您的智慧，而我會永遠做您虔誠的侍者……"],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"對於祭司來說這肯定就像美夢成真一樣。他們兩個關係很好我很高興。但是，事情有點不對勁，不是嗎，酋長？"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"部落的長者們都說去找所謂的海的人沒有一個回來的，哦除了那個回來之後成了個瘋子的，嘴裡念叨著什麼在世界的盡頭有一堵水造的高牆。"],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"但是那個阿梅金說他們是海上的民族！沒人住在海上！"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"就這就是為什麼事情有些蹊蹺。但是他目前也沒害我們，我們就先不管他了，去完成自己的工作吧。"],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"您現在已經探索了很大一片區域了，我們獲得的大量戰利品已經要把營地塞滿了。牲畜可以幫我們把它們運回家園。為了它們的舒適，我們應該給它們建造一個<color=#f58c26>牲畜棚</color>。"],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"看起來不錯，酋長！看起來這些小傢伙們很快就能派上用場，太棒啦！"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"我們的建設工作馬上就要完成了，只是我這裡還有一個忙需要您幫。"],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"以防萬一有圖謀不軌之徒在咱們離開營地之後摧毀我們的勞動成果，我們需要一支專業的斥候小隊來在周圍巡邏。"],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"我們需要為他們建一個<color=#f58c26>訓練場</color>！"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"說對了凱文，一個<color=#f58c26>訓練場</color>！我們去尋找材料吧！"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1080101","TextValue"=>"準備好了嗎？"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1080102","TextValue"=>"準備好了長官！"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1080103","TextValue"=>"酋長已經準備好了材料，就等咱們開工啦！"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1080104","TextValue"=>"好的長官，沒問題長官！"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1080201","TextValue"=>"幹得漂亮！然後現在我們……祭司？有什麼不對嗎？"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1080301","TextValue"=>"我剛才在跟大德魯伊阿梅金先生說話，接著我們都因為太累了而陷入了夢鄉。接著我們都夢見了同一個夢，夢裡一個女神跟我們說“救救<color=#f58c26>海洋之心</color>……”"],
13690=>["Value"=>13690,"TextKey"=>"剧情ID1080302","TextValue"=>"<color=#f58c26>海洋之心</color>？那是什麼？"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID1080303","TextValue"=>"我的民族有一個傳說，說是深海中有一個巨大的氣泡，被那位最年幼的女神所庇佑著。氣泡中不光古老的動物存活了下來，巨人和精靈也生活在其中。但是這只是個哄小孩的睡前故事罷了。"],
13692=>["Value"=>13692,"TextKey"=>"剧情ID1080304","TextValue"=>"我必須把這事研究明白。為了能把女神的資訊聽得更清楚，我需要一個<color=#f58c26>強大符文底座</color>。"],
13693=>["Value"=>13693,"TextKey"=>"剧情ID1080305","TextValue"=>"收到！好的，酋長，咱們去找一些原石來，把那個底座給恩達建起來吧！"],
13694=>["Value"=>13694,"TextKey"=>"剧情ID1090101","TextValue"=>"馬上就能收工了，是時候慶祝一下了！"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID1090102","TextValue"=>"太棒啦！"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID1090201","TextValue"=>"先別慶祝呢！你們這麼鬧騰我根本沒法集中注意力！"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID1090202","TextValue"=>"我正在嘗試和神建立聯繫，結果被你們這群小屁孩給毀了！"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID1090203","TextValue"=>"閉上你們的嘴然後讓我好好工作！"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID1090204","TextValue"=>"誒喲，看起來某人心情不太好的樣子。"],
13700=>["Value"=>13700,"TextKey"=>"剧情ID1090205","TextValue"=>"等等！安靜！我覺得我好像能聽見她的聲音了。這事很重要。"],
13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"嗯……我聽不太清……但是我猜，她是說我們該向北走，那裡不光是沒有飛鳥走獸，更是寸草不生。在那裡我們能找到一個朋友。"],
13702=>["Value"=>13702,"TextKey"=>"剧情ID1090207","TextValue"=>"好吧，聽起來……也不是不可行？我是說，能出什麼事呢？那就向北出發！"],
13703=>["Value"=>13703,"TextKey"=>"剧情ID1090208","TextValue"=>"但是在此之前，我們終於可以慶祝我們新營地的建成啦！大家都圍過來，我們要開場盛大的派對！"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID1090209","TextValue"=>"萬歲！"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID1090301","TextValue"=>"我們離開家的時候，以為可能再也回不去了。但是我們找到了這座不可思議的小島，結識了新的朋友，甚至還找到了復活那些我們以為已經離我們而去的部落成員的方法！"],
13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"所有的這一切，我們必須感謝我們的女神。她一直在庇佑我們並為我們指引方向；接著我要感謝我們的新朋友，親愛的阿梅金，他一直在無私地向我們傳授他那淵博的學識。"],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"但最重要的是，酋長，如果您沒有像從前那樣保持堅強和友善，我們將不可能做到這一切。所以，謝謝您為我們做的一切。呃……祭司，你在哭嗎？"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"我……我沒有……*抽鼻子*沒有哭！只是……*抽鼻子*好吧，我有！我在哭！現在你們都滿意了嗎？！我愛你酋長！你是最棒的酋長！"],
13709=>["Value"=>13709,"TextKey"=>"剧情ID1090305","TextValue"=>"哈哈，我相信這足以說明問題了，酋長。我等不及想看看我們未來的旅途是什麼樣的。總有一天，我們一定會解決我們家園的謎團，並重建我們的家。"],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2010101","TextValue"=>"別著急男孩們，我們馬上就到了……"],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2010102","TextValue"=>"神保佑！我們在沙漠裡已經走了好幾天了，或許你可以給我點水喝嗎？"],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2010103","TextValue"=>"有點耐心！我在你這麼大的時候……嘿這是什麼？"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2010201","TextValue"=>"嗚哇啊啊啊啊啊啊啊啊啊！"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2010202","TextValue"=>"祭司？！"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2010203","TextValue"=>"哦不，你在下麵嗎，祭司大人？你還好嗎？"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2010204","TextValue"=>"嗯……我還活著……嗯，我想我被這個……..魔法礦洞給吸進來了。"],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2010205","TextValue"=>"噢感謝神，你還好。請放心，我們會盡最大的努力儘快把您救出來的。"],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2010301","TextValue"=>"酋長，我在附近的山頂上發現了一棟廢棄的建築。我看到裡面有一台巨大的草繩機，但它被埋在亂七八糟的垃圾堆裡。"],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2010302","TextValue"=>"我猜它是某種<color=#f58c26>舊工坊</color>。"],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2010303","TextValue"=>"也許我們可以試著打開它的門，把裡面打掃一下，然後做條草繩，建個滑輪架子，把祭司拉上來？"],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2010304","TextValue"=>"別閒聊了，快去把那個滑輪的玩意建起來！"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2010305","TextValue"=>"別那麼著急嘛，祭司大人。天要黑了，再待在外面我們就要凍死了。所以我打算建個<color=#f58c26>帳篷</color>，等大家休息好了再來想辦法。"],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2010306","TextValue"=>"那我怎麼辦？！我會凍死的！"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2010307","TextValue"=>"不要擔心，儘管這裡地上的日夜溫差很大，地下的溫度總是又舒適又穩定的。再堅持一會兒吧，祭司大人！"],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2020101","TextValue"=>"第二天……"],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2020201","TextValue"=>"這覺睡得真舒服！我的祭司，您在下面感覺如何？"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2020202","TextValue"=>"與其來問我感覺如何，不如快點想辦法把我弄上去！"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2020203","TextValue"=>"我們正在想呢，只是還需要點必需的工具才能鑿開山頂那座工坊的門。別著急，好嗎？*微笑*"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2020204","TextValue"=>"你等我上來……你這個狂妄自大的小屁孩……"],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2020205","TextValue"=>"啊呀，我好受傷！你怎麼可以這樣誤解我的好意！但是我原諒你了。酋長和我會馬上回來的！"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030201","TextValue"=>"好了，我們進來了！現在我們只需要……"],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030202","TextValue"=>"長官，小心！在你身後！"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030203","TextValue"=>"啊！這支箭是從哪來的？！"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030204","TextValue"=>"出來！"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030205","TextValue"=>"誰在那兒？"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030206","TextValue"=>"出來！綁架犯！"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2030207","TextValue"=>"綁架犯？我覺得你抓錯人了，聲音女士……啊啊疼！疼！"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"聲音女士，我們現在出來了。你可以給我解釋一下現在是什麼情況嗎？"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2030302","TextValue"=>"首先，我不叫聲音女士，我是特拉齊嘉，閃電的捕獵者，莫洛斯之女，大地之母，女英雄……"],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2030303","TextValue"=>"偉大的特拉齊嘉！！！！！"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2030304","TextValue"=>"什……這個聲音是從哪兒……從山腳？有人掉進那個礦洞了？"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"你們仨，我回來之前待在這兒不許動！如果我發現你們挪了一步，你們知道會發生什麼。"],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2030306","TextValue"=>"好的女士，一步也不動！"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2030401","TextValue"=>"你在那兒啊。一個祭司？你在這下面做什麼？我在找人的時候把這個礦洞打開了，但是你怎麼在這裡面？"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"長話短說，我跟那邊那些被你抓住的小男孩是一道來的，但是我掉進了這個礦洞。但是那不重要。我們遇見您了！！我預言我們會在這片荒蕪的土地上遇見一位能幫助我們的朋友，想不到居然是您！！"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2030403","TextValue"=>"朋友？幫助你們？幫什麼？你們……不是綁架犯？"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"綁架犯？不不不，我們只是路過的，在旅途中努力尋找能夠拯救我們家園的幫手……*解釋*"],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2030405","TextValue"=>"哈。你這麼一說，我媽確實說過會遇見像你們這樣的一群人……但是接著她人就不見了。所以我確實是抓錯人了。"],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2030406","TextValue"=>"媽媽？"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2030407","TextValue"=>"別管了，不是什麼大事。我猜你的那些男孩們想修好那個草繩機來把你釣出來，才掉進我的陷阱的？"],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2030408","TextValue"=>"是的，智慧的女士，您說的對。這就是為什麼我現在成了這個樣子，只剩一隻腳能用了。"],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2030409","TextValue"=>"哦天，對不起，我的錯。我一會兒幫你療傷。現在我先幫你們把我的陷阱給拆了，再把那個草繩機修好……"],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2030501","TextValue"=>"草繩機修好了，太棒啦女士！"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2030592","TextValue"=>"一點也不好！快把我拉上去！現在，馬上！"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2030683","TextValue"=>"現在還剩下一步，就是我們得做點草繩，才能把你釣上來。"],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2030774","TextValue"=>"我覺得你在針對我……*哭*"],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2040101","TextValue"=>"我的酋長，您已經收集完所有的材料了嗎？其實您慢點也沒關係，因為現在恩達祭司不在這兒， 我們終於能清淨一會兒了……"],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2040102","TextValue"=>"我能聽見你說話！放尊重點！"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2040103","TextValue"=>"糟糕！不知道她還能聽見……啊哈！滑輪準備好了！"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2040201","TextValue"=>"親愛的祭司，救援小隊已經下去了，請站在別人能看見的地方，以防發生踩踏事故……"],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2040202","TextValue"=>"你踩到我的腰了！從我身上下去！"],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2040203","TextValue"=>"看起來祭司很快就能上來了，非常感謝您，女士。"],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2040204","TextValue"=>"別叫我女士，我叫特拉齊嘉。現在給我看看，我剛才傷到你哪兒了？"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2040205","TextValue"=>"您傷到了我的小腿，女士，啊不，特拉齊嘉。"],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2040206","TextValue"=>"明白了。我們這些獵人很擅長照料傷口的。我在礦洞下麵存了袋多肉葉子，我把礦洞當儲存室來著。我們種些葉子，然後把那些汁水抹在你的小腿腿上~"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2040207","TextValue"=>"額……小腿腿……好吧。所以我們現在就下到礦井裡去？"],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2040208","TextValue"=>"不不不，你們這些小菜鳥在下面需要用火把才能看見。這下面比你們想得要深多了。去找點火把和發掘工具來吧！"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2050101","TextValue"=>"拿著這個，如果火滅了，就不要往前走，停下然後回來，好嗎？"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2050102","TextValue"=>"準備好了嗎？我們走！小心腳下！"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2050103","TextValue"=>"好的女士！"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2050104","TextValue"=>"酋長，您願意和我還有祭司一起留在上面，我很感謝。特拉齊嘉說我現在這樣子，除非我這條腿不想要了，不然不能下井，我還挺惋惜的。但是好期待他們會給我們帶來什麼新發現呀！"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2050105","TextValue"=>"我真不敢相信偉大的特拉齊嘉竟然讓你直呼她的名字。多麼大的榮耀！然後你一點也沒有感激的意思……"],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2050201","TextValue"=>"我的神啊那是什麼？"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2050202","TextValue"=>"是地下河！我們的隊伍竟然找到了一條<color=#f58c26>地下河</color>！我們有水了！"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2050203","TextValue"=>"也濕透了。"],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2050204","TextValue"=>"你們這些嬌氣包忍著點！只是點水而已！"],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2050205","TextValue"=>"嘿，你，那個酋長，你現在有水了，我們來種點<color=#f58c26>多肉植物</color>吧！一片葉子加上誦經和適當的護理，馬上就能長成一棵漂亮的多肉植物啦！"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2050206","TextValue"=>"這些姑娘們歸你了。去讓他們找點水桶鐵鍬和肥料，我在這兒等著。"],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2060101","TextValue"=>"好了弄完了！看它多可愛！來揪片葉子下來，要大的。"],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2060102","TextValue"=>"我從來沒見過這種植物……什麼？你說要揪一片下來？"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2060103","TextValue"=>"對，拿一片，把它的汁水擠出來，塗抹在你受傷的皮膚上。"],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2060104","TextValue"=>"好吧……拿一片……抹……哇，真的管用誒！我從來沒聽說過哪種草藥治癒傷口能這麼快！"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"嘛，大地之母也不是白叫的。我猜人們給我起了這個昵稱，是因為我的園藝功夫很棒。這些可不是普通的多肉，是我培育的。"],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2060106","TextValue"=>"奇跡創造者！天哪！現在我覺得我們所有家園的謎團很快就能解開了！"],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2060107","TextValue"=>"說實話，關於那件事。我現在筋疲力盡，急需睡上一覺。你介意我去你們那個啥家園打個盹嗎？它是像個基地一樣的麼？有床嗎？"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2060108","TextValue"=>"對，它是有點像個基地，然後這是回去的地圖。但是……你是計畫去過個夜，還是你會加入我們的隊伍啊？"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2060109","TextValue"=>"當然是加入你們的隊伍了，你是傻嗎？！你們需要幫助，我現在也不忙，為什麼不呢？我們反正估計是在找同一個人。所以！地圖我就拿走啦，拜拜！"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2060201","TextValue"=>"然後她就走了。我感覺她會和我們的人民成為好朋友的。我們繼續我們手頭的工作，建完營地吧。就像是我們之前的營地一樣，我們需要一個儲存資源的<color=#f58c26>倉庫</color>。"],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2060202","TextValue"=>"我們去收集一些建造<color=#f58c26>倉庫</color>的資源吧！"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2070101","TextValue"=>"太棒了！"],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2070102","TextValue"=>"你還沒感謝我給你們找到水源呢！告訴你我對這地方的感覺是對的！"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2070103","TextValue"=>"好的，好的。我以後全心全意相信你的占卜，滿足你一切的無理要求。接下來你需要什麼呢？"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2070104","TextValue"=>"你……！算了。我需要跟神再次交流，來確定接下來前進的方向。這次我需要一個<color=#f58c26>瞭望塔</color>來試試天文學占卜。"],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2070105","TextValue"=>"為什麼選擇天文學？我們甚至都不知道那些星星是什麼，我是說，他們只是天上的一些小亮點！"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2070106","TextValue"=>"我們沒時間浪費了！有一大堆活要幹呢！別再胡謅了！"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2070107","TextValue"=>"去把我要的東西給我找來，快去！"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2070108","TextValue"=>"好吧……"],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2070201","TextValue"=>"大人都說不要惹難纏的老人，我怎麼就不聽呢……"],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2080101","TextValue"=>"好了酋長，你幹完你要幹的了，剩下的就是建祭司讓我建的那個<color=#f58c26>瞭望塔</color>了……"],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2080102","TextValue"=>"我聽著呢你這個傢伙！別抱怨了，幹你的活！"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2080103","TextValue"=>"好吧~好吧~*歎氣*"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2080201","TextValue"=>"好了，我的酋長，我要去跟神說話了。"],
13803=>["Value"=>13803,"TextKey"=>"剧情ID2080202","TextValue"=>"您可以休息一下，一會兒見。"],
13804=>["Value"=>13804,"TextKey"=>"剧情ID2080203","TextValue"=>"*小聲*這裡這裡，酋長……"],
13805=>["Value"=>13805,"TextKey"=>"剧情ID2080204","TextValue"=>"恩達終於可以消停會兒了。"],
13806=>["Value"=>13806,"TextKey"=>"剧情ID2080205","TextValue"=>"我們的隊員在礦下找到一堆金子。"],
13807=>["Value"=>13807,"TextKey"=>"剧情ID2080206","TextValue"=>"我們在想能不能做一個箱子來把他們運上來，所以來這裡找您幫忙。"],
13808=>["Value"=>13808,"TextKey"=>"剧情ID2080207","TextValue"=>"您介意幫我們收集一些做箱子的材料嗎？"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID2090101","TextValue"=>"呼，這可真是不少金子。"],
13810=>["Value"=>13810,"TextKey"=>"剧情ID2090102","TextValue"=>"這是什麼？它在發光……"],
13811=>["Value"=>13811,"TextKey"=>"剧情ID2090201","TextValue"=>"是個小袋子……上面寫著“吃我”。裡面是……一顆<color=#f58c26>發光的種子</color>？它是說，把這個種子吃了嗎？"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID2090202","TextValue"=>"放下我來！"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID2090203","TextValue"=>"什麼？！祭司大人，您在幹什麼！"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID2090301","TextValue"=>"你剛剛把它吃了嗎？！我們還沒研究清楚它是什麼呢！"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID2090302","TextValue"=>"星象指引我向位於<color=#f58c26>東南方</color>的<color=#f58c26>大峽谷</color>而去，而這顆<color=#f58c26>催眠種子</color>會幫助我遇見……*打呼嚕*"],
13816=>["Value"=>13816,"TextKey"=>"剧情ID2090303","TextValue"=>"祭司？祭司？你還在嗎？"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID2090304","TextValue"=>"*打呼嚕*"],
13818=>["Value"=>13818,"TextKey"=>"剧情ID2090305","TextValue"=>"然後她就睡著了。我不太理解這些通靈的傢伙。他們有時候挺莫名其妙的。"],
13819=>["Value"=>13819,"TextKey"=>"剧情ID2090306","TextValue"=>"呃，祭司暈過去了，那我們接下來該去哪兒呢？"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID2090307","TextValue"=>"她說了<color=#f58c26>大峽谷</color>，對吧？去<color=#f58c26>東南方</color>？"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID2090308","TextValue"=>"我們該信她嗎？她現在看起來……有點不正常？"],
13822=>["Value"=>13822,"TextKey"=>"剧情ID2090309","TextValue"=>"當然。我答應了她我今後會相信她。另外，我們還能去哪兒呢？今天就讓我們先休息，然後明天向東南方出發。"],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3010101","TextValue"=>"喂，那邊那個。"],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3010102","TextValue"=>"我？"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3010103","TextValue"=>"對！你。你介意給老太太搭把手嗎？"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3010104","TextValue"=>"額……我其實不在這裡。"],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3010105","TextValue"=>"哈？為啥？"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3010106","TextValue"=>"我和我的部落成員在一起。我們正在四處旅行，尋找能夠幫助我們解開家園謎團的幫手……"],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3010107","TextValue"=>"曉得了。我其實是在跟你的腦子說話，通過你手裡那個發光小方塊？"],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3010108","TextValue"=>"你是說我的<color=#f58c26>手機</color>？"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3010109","TextValue"=>"對的，那個<color=#f58c26>“你的手機”</color>。你願意幫幫我嗎？"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3010110","TextValue"=>"等等……為什麼你能聞見我？"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3010111","TextValue"=>"噢親愛的，我雖然是個瞎子，但是我什麼都能感受到。你會明白的。現在，你願意幫我嗎？"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3010112","TextValue"=>"好吧。你需要什麼？"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3010113","TextValue"=>"你的部落的人會經過這兒吧？我假裝自己是個饑腸轆轆的人，建個<color=#f58c26>小攤兒</color>賣我的破爛。天哪！我是個天才！"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3010114","TextValue"=>"我不懂……"],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3010115","TextValue"=>"我不想幫隨隨便便的什麼粗魯傢伙，對吧？我只幫好人。"],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3010116","TextValue"=>"所以呢？"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3010117","TextValue"=>"所以如果他們買我的東西然後給我食物，他們就還可以。或者更好，他們直接給我食物！"],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3010118","TextValue"=>"否則，對不住了，我一個響指，你的部落就灰飛煙滅了。懂嗎？所以，進入關卡幫我收集點材料吧！"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020101","TextValue"=>"漂亮！謝謝你們！"],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020102","TextValue"=>"我希望我的女兒像你一樣可靠又手腳麻利。"],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020103","TextValue"=>"我們之前在沙漠裡走散了，然後我就迷路了……我方向感不太好。"],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020104","TextValue"=>"你知道她現在在哪兒嗎？"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3020105","TextValue"=>"我當然知道！但是她也不能不來找我啊！"],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3020201","TextValue"=>"這樣挺好的，你知道嗎？就你和我，很放鬆，聊聊天，說說八卦……"],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3020301","TextValue"=>"他們會來的，我們只是需要等一會兒。"],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3020302","TextValue"=>"……"],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3020303","TextValue"=>"很久之後"],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3020304","TextValue"=>"我要爬上那堆骨頭瞅瞅他們到底到哪兒了。"],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3020401","TextValue"=>"哈！他們就在那兒！你那個小祭司好帥呀！"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3020402","TextValue"=>"好了他們就要到了。我很期待和他們見面！現在我只需要小心地走下來……"],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3020501","TextValue"=>"你還好嗎？"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3020502","TextValue"=>"喂？"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3020601","TextValue"=>"過了一會兒"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3020701","TextValue"=>"“餓死了，請買東西，給我點食物。”嗯……有人在這兒創業了。"],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3020702","TextValue"=>"啊，酋長，您來了。祭司說夢裡有人叫他來龍骨這裡見面。"],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3020703","TextValue"=>"果然這兒有人活動的痕跡。不過這個火堆余溫已散，四周也不見人影……莫非我們被放了鴿子？"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3020704","TextValue"=>"不管怎樣，我們在此處紮營歇歇腳，順便等等祭司說的那個人吧！"],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3020801","TextValue"=>"累死我了，終於到了...就這麼暴曬，還被大披風捂著，我這老骨頭快熟了！趕緊把我這披風脫了！"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3020802","TextValue"=>"敬愛的祭司，您剛才在駱駝背上睡得很香，沒資格說累死了。"],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3020803","TextValue"=>"然後，您還不能脫下您的披風。戈壁和沙漠地區雖然白天酷熱，但夜晚格外寒冷。"],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3020804","TextValue"=>"神啊…為什麼您要把我引到這個鬼地方來…還要忍受這個傲慢的年輕人……"],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3020805","TextValue"=>"請再稍加忍耐，酋長會儘快幫我們收集好建造旅居<color=#f58c26>帳篷</color>的材料。"],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3030101","TextValue"=>"不愧是您，這麼快就收集好了材料，那就讓我們動工吧！"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3030201","TextValue"=>"想必大家也都餓了，我們正好就借用這個篝火來做點飯、搭一個簡易的休息區休息一下。吃飽了才有力氣幹活嘛！"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3030202","TextValue"=>"太好了！！！吃的！培根！"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3030203","TextValue"=>"我想吃羊排……"],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3030204","TextValue"=>"你們這些殘暴的食肉動物！"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3030205","TextValue"=>"你要什麼？"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3030206","TextValue"=>"牛排，五成熟，配辣根醬，謝謝。"],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3030207","TextValue"=>"祭司大人，那個也是……"],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3030208","TextValue"=>"我知道！閉嘴！"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3030209","TextValue"=>"哈哈，對於旅行在外的人來說，補充蛋白質是很重要的。這一路上不容易，所以我們得吃頓好的！酋長，您意下如何？"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3030210","TextValue"=>"我們沒有那麼多食材……"],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3030211","TextValue"=>"我們有羊肉、牛肉幹和蘋果，酋長大人！"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3030212","TextValue"=>"但是酋長說的在理，我們還要為之後的極端天氣做準備。所以我們需要去找點別的蛋白質來當替代品。"],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3030213","TextValue"=>"路上我看見了一些沙漠蜥蜴。蜥蜴卵，和它們自己都是很好的蛋白質來源！"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3030214","TextValue"=>"你說什麼？！蜥蜴？！那東西能吃？！"],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3030215","TextValue"=>"這些稀有食材加上一點點創意就能成為珍饈！比如，蜥蜴燉雜蔬，就聽起來特別美味！"],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3030216","TextValue"=>"我等不及啦！"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3030217","TextValue"=>"哦……抓蜥蜴……"],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3040101","TextValue"=>"好極了！您把材料都收集好了，咱們開始吧！"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3040102","TextValue"=>"來了！點燃篝火！"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3040201","TextValue"=>"終於……食物……我動不了了……煎蛋……牛排……烤蘋果……"],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3040202","TextValue"=>"阿蘭的羊排，然後是凱文的煎蛋……恩達祭司會和我一起享用這碗美味的蜥蜴燉雜蔬……"],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3040301","TextValue"=>"沒人跟你吃燉蜥蜴！"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3040302","TextValue"=>"好吧，看來這碗熱氣騰騰的美味燉菜要給我們的新朋友了。"],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3040303","TextValue"=>"新朋友？什麼新朋友？"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3040401","TextValue"=>"啊！！！！我的神啊！！！把這些老鼠從我身上弄下去！"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3040402","TextValue"=>"首先，老鼠不可能這麼大。根據我的觀察，它們是沙漠和戈壁地區特有的一種生物，沙鼠。"],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3040403","TextValue"=>"儘管體型不小，但它們一般都膽小敏感，所以性情溫和的它們對人是完全無害的。"],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3040404","TextValue"=>"好了好了我知道了！！！我不在乎這堆東西是啥，趕緊給我弄下去！"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3040405","TextValue"=>"你這麼一說，有點奇怪。這些沙鼠為什麼完全不怕你呢？"],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3040406","TextValue"=>"親愛的工人們，能請你們把這些可愛的小傢伙們從祭司身上移走嗎？"],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3040407","TextValue"=>"沒問題！"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3040501","TextValue"=>"嘿！！！！還給我！！！"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3040502","TextValue"=>"然後它們就這麼跑了。好像它們還是有點怕祭司以外的人？"],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3040503","TextValue"=>"它們搶走了我的戒指！我親愛的戒指……"],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3040504","TextValue"=>"可憐的祭司……我猜我們可以去看看那堆龍骨？反正我對那些小傢伙也有點興趣。"],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3040505","TextValue"=>"但是那兒地勢陡峭，我們需要一個<color=#f58c26>風車</color>來運送工人。"],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3050101","TextValue"=>"風車的材料已經備好了嗎？好！那擼起袖子把它建起來吧！"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3050102","TextValue"=>"熱乎的風車馬上來！"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3050201","TextValue"=>"多漂亮的風車！這樣我們上下陡坡更安全也更方便啦！"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3050202","TextValue"=>"好！趕緊把我的戒指拿回來！它神聖得很！"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3050203","TextValue"=>"好好！我們去！凱文，阿蘭，你們準備好了嗎？"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3050204","TextValue"=>"時刻準備著！"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3050205","TextValue"=>"嗯……長官……不是說我膽小，但是我覺得以防我們從懸崖上掉下來，我們需要點繩子……"],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3050206","TextValue"=>"啊哈！你說得太對了，工作安全永遠第一！所以酋長，再請您幫忙弄點安全工具來啦。"],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060101","TextValue"=>"準備好了嗎？"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060102","TextValue"=>"準備好了！"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060103","TextValue"=>"漂亮！我們現在就去解開那些沙鼠的謎團吧！好期待呀！"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060104","TextValue"=>"別忘了我的戒指！"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060201","TextValue"=>"哇哦，這個骨頭堆真夠深的！等等……在底部有個閃閃發光的東西……嗯……是不是恩達的戒指呢？"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060202","TextValue"=>"酋長！看我們找到了什麼！一個灰頭土臉的老太太！"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060203","TextValue"=>"還有祭司的戒指。"],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060301","TextValue"=>"*熱淚盈眶*阿蘭，太感謝你了，你是咱們這群人裡最講理的那個……等等……什麼？"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060401","TextValue"=>"*激動的吱吱聲*"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060402","TextValue"=>"我猜……謝謝你們？"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3060403","TextValue"=>"*高興的吱吱聲*"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3060501","TextValue"=>"*激動的吱吱聲*"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3060502","TextValue"=>"哦！你們好！你們好熱情！我認識你們嗎？這毛皮摸起來有種熟悉的感覺……"],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3060503","TextValue"=>"噢！然後你一定就是剛才我夢裡的那個小祭司吧！現實中的你比夢裡還要可愛~"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3060504","TextValue"=>"小？你竟敢說我小？！我是尊貴的神的信使…"],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3060505","TextValue"=>"抱歉，您說您夢到了我們的祭司？"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3060506","TextValue"=>"噢~年輕人！是的！我夢見了這位小祭司，我還夢見我跟她說：“我在這裡等你。”但是我完全不知道那是什麼意思！"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3060507","TextValue"=>"什麼叫做你不知道那是什麼意思？！"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3060508","TextValue"=>"其實說來好笑，我完全不記得我的名字，所以更不知道我那個奇奇怪怪的夢是什麼意思。"],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3060509","TextValue"=>"我掉進坑的時候腦袋肯定撞得不輕。我現在走路還有點搖搖晃晃呢。"],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3060510","TextValue"=>"旁邊這個小攤位是您的嗎？上面寫著“餓死了，請買東西，請給我食物“？"],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3060511","TextValue"=>"這地方挺荒涼的，再加上這個小攤位上寫的東西準確地描述了我目前的身體狀態與內心獨白。我猜它是我的。"],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3060512","TextValue"=>"不用擔心，我們帶了很多的食物，請您到我們的帳篷裡面享用。"],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3060513","TextValue"=>"太好了！"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3060514","TextValue"=>"噢，不過有件事。我在空氣中聞到培根、烤蘋果、和……一場<color=#f58c26>即將到來的風暴</color>的味道。你們最好做好準備。"],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3060601","TextValue"=>"然後……她就這麼走了。好吧，酋長，您也聽到了，這兒風很大很凶，我看看……"],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3060602","TextValue"=>"咱們的帳篷需要進一步加固。"],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3060603","TextValue"=>"我們憑什麼要聽她的！那傢伙來頭不明不白，然後你就信她的話！"],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3060604","TextValue"=>"我的預言，你總是揪住一處差錯嘲笑個不停！我一定要問出個所以然來，讓這老女人現出真面目來！"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3060605","TextValue"=>"哈哈哈哈，我們的祭司還挺不服氣的。<color=#f58c26>加固帳篷</color>的材料清單已經為您備好了，酋長大人，請您查看。"],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3070101","TextValue"=>"嗯，好茶。"],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3070102","TextValue"=>"這餅乾也不錯，入口即化。就是邊緣稍稍烤焦了一點。"],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3070103","TextValue"=>"下次火候小一點，然後適當延長一些時間就完美了。"],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3070104","TextValue"=>"為什麼她在吃下午茶？！"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3070105","TextValue"=>"有什麼問題嗎？"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3070106","TextValue"=>"然後那個奇奇怪怪的英式口音是怎麼回事！我們甚至不在正確的時代！"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3070107","TextValue"=>"放鬆一點，可愛的小祭司。一切都會過去的，你會明白的。"],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3070108","TextValue"=>"不！不會！沒有事情會過去，然後我也什麼都不明白！！神啊……你到底是從哪裡來的啊！"],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3070109","TextValue"=>"既然你虔誠地發問了，實際上，多虧了剛才的下午茶……"],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3070110","TextValue"=>"我的記憶已經有所恢復。事實上，我是說，誠實地說，講道理，說實話……"],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3070111","TextValue"=>"能不能直說？！"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3070112","TextValue"=>"那個<color=#f58c26>小攤位</color>，能拜託你們也幫我加固一番嗎？"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3070113","TextValue"=>"什麼？！"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3070114","TextValue"=>"在戈壁灘上，我一個瘦弱的老人，一個人孤單地走了很久，已經是饑腸轆轆……哎！真可憐！"],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3070115","TextValue"=>"要是這攤位壞了，我會很難過的。所以，拜託你們了！感激不盡！"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3070116","TextValue"=>"多有趣的老太太。"],
13956=>["Value"=>13956,"TextKey"=>"剧情ID3070117","TextValue"=>"對不起你說什麼？！"],
13957=>["Value"=>13957,"TextKey"=>"剧情ID3070118","TextValue"=>"酋長大人，材料清單已經為您準備好了，請您查看！"],
13958=>["Value"=>13958,"TextKey"=>"剧情ID3070119","TextValue"=>"不要無視我！！天哪我受不了了！"],
13959=>["Value"=>13959,"TextKey"=>"剧情ID3080101","TextValue"=>"真好，你們太棒了！"],
13960=>["Value"=>13960,"TextKey"=>"剧情ID3080102","TextValue"=>"媽！我就知道！我就知道是你！"],
13961=>["Value"=>13961,"TextKey"=>"剧情ID3080201","TextValue"=>"偉大的特拉齊嘉，您為什麼在這裡？！"],
13962=>["Value"=>13962,"TextKey"=>"剧情ID3080202","TextValue"=>"這位年輕的女士是……？"],
13963=>["Value"=>13963,"TextKey"=>"剧情ID3080203","TextValue"=>"特拉齊嘉！你女兒！別裝了！"],
13964=>["Value"=>13964,"TextKey"=>"剧情ID3080204","TextValue"=>"傳信兒的告訴我他們在一坑裡挖出來一個瞎眼老婆子，聽起來像你，我就來看看。"],
13965=>["Value"=>13965,"TextKey"=>"剧情ID3080205","TextValue"=>"果然是你！"],
13966=>["Value"=>13966,"TextKey"=>"剧情ID3080206","TextValue"=>"特拉齊嘉的母親……我從未聽說過特拉齊嘉有母親……"],
13967=>["Value"=>13967,"TextKey"=>"剧情ID3080207","TextValue"=>"我當然有母親你個傻蛋！"],
13968=>["Value"=>13968,"TextKey"=>"剧情ID3080208","TextValue"=>"注意語言。"],
13969=>["Value"=>13969,"TextKey"=>"剧情ID3080209","TextValue"=>"這個瘋瘋癲癲的女士就是你們的莫洛斯。就在你們眼前。"],
13970=>["Value"=>13970,"TextKey"=>"剧情ID3080210","TextValue"=>"叫我麥格就好。"],
13971=>["Value"=>13971,"TextKey"=>"剧情ID3080211","TextValue"=>"但是我以為莫洛斯是男的……"],
13972=>["Value"=>13972,"TextKey"=>"剧情ID3080212","TextValue"=>"好吧，我的母親可以是很多人。我小時候，她向人們隱藏了自己的真實身份。"],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3080213","TextValue"=>"你想，誰比盲人女人和三歲大的人更容易被利用？"],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3080214","TextValue"=>"我想，人們就是開始這樣傳播這個故事的……無所不能的德魯伊，無所不知的戰士，強大的騎士……"],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3080215","TextValue"=>"實際上，她只是一個有奇怪幽默感的失明老太婆。"],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3080216","TextValue"=>"莫洛斯是女人……然後我對莫洛斯出言不遜……噢，我完了，我不配做祭司……"],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3080217","TextValue"=>"小祭司，不要悲傷。你會學乖的~這次我原諒你了，因為你真是太可愛了~"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3080218","TextValue"=>"所以你騙了我們？你沒有失憶？"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3080219","TextValue"=>"是的...很抱歉。長途旅行很無聊，對吧？只是找點樂子〜"],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3080220","TextValue"=>"但是，嘿，看那美麗的帳篷和那美麗的小鋪子！現在這才像個“營地”！只是總覺得還缺點什麼……"],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3080221","TextValue"=>"缺點什麼？"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3080222","TextValue"=>"我看看……"],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3080301","TextValue"=>"一個大門！你們需要一個大門來標記營地的入口，然後再點綴些燈，就會變得無與倫比地美！"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3080302","TextValue"=>"我們作為您虔誠的僕人，會立刻去建造那座大門，女士！酋長，別磨磨蹭蹭的了！"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090101","TextValue"=>"材料都準備好了？好！快去幹活快去幹活！"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090201","TextValue"=>"噢！我感到活力四射！這是我第一次負責建築項目……"],
13987=>["Value"=>13987,"TextKey"=>"剧情ID3090202","TextValue"=>"恭喜你，祭司，你成長了許多。但是不知道麥格對我們的營地現在的樣子滿不滿意呢？"],
13988=>["Value"=>13988,"TextKey"=>"剧情ID3090203","TextValue"=>"其他的都很好，但是這個空蕩蕩的天空有點無聊……"],
13989=>["Value"=>13989,"TextKey"=>"剧情ID3090204","TextValue"=>"我知道！我知道！我們有一些能飄在天上的信號氣球！"],
13990=>["Value"=>13990,"TextKey"=>"剧情ID3090205","TextValue"=>"好主意！這些小東西需要些微調，就會更漂亮啦！"],
13991=>["Value"=>13991,"TextKey"=>"剧情ID3090206","TextValue"=>"你們那些發光的黃色粉色小石頭還有剩嗎？"],
13992=>["Value"=>13992,"TextKey"=>"剧情ID3090207","TextValue"=>"有的！"],
13993=>["Value"=>13993,"TextKey"=>"剧情ID3090208","TextValue"=>"太好了，稍等一下。凱文，跟我來。"],
13994=>["Value"=>13994,"TextKey"=>"剧情ID3090301","TextValue"=>"咳，累死我了。但是看看這些小玩意！它們美不美？"],
13995=>["Value"=>13995,"TextKey"=>"剧情ID3090302","TextValue"=>"確實。"],
13996=>["Value"=>13996,"TextKey"=>"剧情ID3090303","TextValue"=>"你們喜歡就好。媽媽做的東西一般都不太正常。總之，時候不早了，我要回去了。"],
13997=>["Value"=>13997,"TextKey"=>"剧情ID3090304","TextValue"=>"現在就走？"],
13998=>["Value"=>13998,"TextKey"=>"剧情ID3090305","TextValue"=>"是啊，不然呢？我才不要跟你們這些臭烘烘的大老爺們擠一個小帳篷！媽媽，你跟我一起走嗎？"],
13999=>["Value"=>13999,"TextKey"=>"剧情ID3090306","TextValue"=>"我一會兒會趕上來的。你的新朋友們看起來真可愛，尤其是這個小祭司~我想和他們再多玩一會兒~"],
14000=>["Value"=>14000,"TextKey"=>"剧情ID3090307","TextValue"=>"媽媽，控制一下你自己。"],
14001=>["Value"=>14001,"TextKey"=>"剧情ID3090308","TextValue"=>"知道啦知道啦，我現在控制住了。畢竟我們以後還有很長的路要一起走。"],
14002=>["Value"=>14002,"TextKey"=>"剧情ID3090309","TextValue"=>"行，那待會兒見。"],
14003=>["Value"=>14003,"TextKey"=>"剧情ID3090401","TextValue"=>"您是在說您會加入我們嗎？"],
14004=>["Value"=>14004,"TextKey"=>"剧情ID3090402","TextValue"=>"當然！為什麼不呢！你們的旅途將會愈發艱險。"],
14005=>["Value"=>14005,"TextKey"=>"剧情ID3090403","TextValue"=>"我做不了什麼，但是至少我能告訴你們點兒未來的事情。"],
14006=>["Value"=>14006,"TextKey"=>"剧情ID3090404","TextValue"=>"不過你們得給我指一下去你們家園的路。我的方向感……難以想像地差。"],
14007=>["Value"=>14007,"TextKey"=>"剧情ID4010101","TextValue"=>"呼……世界上為什麼會有這種地方存在！我的腳好像一直踩在了火焰上……"],
14008=>["Value"=>14008,"TextKey"=>"剧情ID4010102","TextValue"=>"了不起，恩達！呼……從四個小時前開始，你已經沒有說出超過五個字的句子了。"],
14009=>["Value"=>14009,"TextKey"=>"剧情ID4010103","TextValue"=>"我……太累了……太熱了……"],
14010=>["Value"=>14010,"TextKey"=>"剧情ID4010104","TextValue"=>"你們這群嬌氣包！區區火山罷了，看看這副恨不得佝僂到地上的樣子！"],
14011=>["Value"=>14011,"TextKey"=>"剧情ID4010105","TextValue"=>"女士……您的汗水也已經成了源源不斷的溪流。您確實還好嗎？"],
14012=>["Value"=>14012,"TextKey"=>"剧情ID4010106","TextValue"=>"叫我特拉齊嘉！……我不累，但是確實太熱了……這裡比海上兇險得多。"],
14013=>["Value"=>14013,"TextKey"=>"剧情ID4010107","TextValue"=>"我們似乎已經到了。"],
14014=>["Value"=>14014,"TextKey"=>"剧情ID4010108","TextValue"=>"讓我看看！女神的指示說，一片燃燒的海，還有其中的島嶼……"],
14015=>["Value"=>14015,"TextKey"=>"剧情ID4010109","TextValue"=>"對，一定就是這裡！"],
14016=>["Value"=>14016,"TextKey"=>"剧情ID4010110","TextValue"=>"可是阿梅金在哪裡？阿梅金應該早就到了，在這裡等著我們才對。但到處看不到他。"],
14017=>["Value"=>14017,"TextKey"=>"剧情ID4010111","TextValue"=>"我需要修建祭壇，來感應阿梅金的資訊。但是……"],
14018=>["Value"=>14018,"TextKey"=>"剧情ID4010201","TextValue"=>"呼……酋長，我……"],
14019=>["Value"=>14019,"TextKey"=>"剧情ID4010202","TextValue"=>"恩達！"],
14020=>["Value"=>14020,"TextKey"=>"剧情ID4010203","TextValue"=>"恩達！"],
14021=>["Value"=>14021,"TextKey"=>"剧情ID4010204","TextValue"=>"她一定是中暑了！快，搭一個陰涼地，讓她歇一歇！"],
14022=>["Value"=>14022,"TextKey"=>"剧情ID4020101","TextValue"=>"長官，修建完畢！"],
14023=>["Value"=>14023,"TextKey"=>"剧情ID4020102","TextValue"=>"神啊，我好像可以多活一會兒了……"],
14024=>["Value"=>14024,"TextKey"=>"剧情ID4020103","TextValue"=>"實在是太熱了吧！我無比懷念海水的味道……"],
14025=>["Value"=>14025,"TextKey"=>"剧情ID4020104","TextValue"=>"呼，我們的祭司大人看上去好多了。"],
14026=>["Value"=>14026,"TextKey"=>"剧情ID4020105","TextValue"=>"有了帳篷雖然好一點，沒了迎面而來的熱風……"],
14027=>["Value"=>14027,"TextKey"=>"剧情ID4020106","TextValue"=>"但也就是好了一點而已。"],
14028=>["Value"=>14028,"TextKey"=>"剧情ID4020107","TextValue"=>"女神在上，把我翻個面吧，這樣烤更均勻。"],
14029=>["Value"=>14029,"TextKey"=>"剧情ID4020108","TextValue"=>"不得不說，這兒的確是個大烤爐。"],
14030=>["Value"=>14030,"TextKey"=>"剧情ID4020109","TextValue"=>"看！那邊的低地。"],
14031=>["Value"=>14031,"TextKey"=>"剧情ID4020110","TextValue"=>"你們等著！我媽可真是生了個天才。"],
14032=>["Value"=>14032,"TextKey"=>"剧情ID4030101","TextValue"=>"偉大的特拉齊嘉！那是水，是水呀！"],
14033=>["Value"=>14033,"TextKey"=>"剧情ID4030102","TextValue"=>"嘿，還以為我們虔誠的祭司大人見到了女神呢。"],
14034=>["Value"=>14034,"TextKey"=>"剧情ID4030103","TextValue"=>"我徹底活過來了，活得相當好！"],
14035=>["Value"=>14035,"TextKey"=>"剧情ID4030104","TextValue"=>"我看你們的確有精神多了！"],
14036=>["Value"=>14036,"TextKey"=>"剧情ID4030105","TextValue"=>"既然這樣，你，你，還有你，快去修建訓練場！"],
14037=>["Value"=>14037,"TextKey"=>"剧情ID4030106","TextValue"=>"訓練場？"],
14038=>["Value"=>14038,"TextKey"=>"剧情ID4030107","TextValue"=>"對，沒錯！"],
14039=>["Value"=>14039,"TextKey"=>"剧情ID4030108","TextValue"=>"我們不是應該找阿梅金？"],
14040=>["Value"=>14040,"TextKey"=>"剧情ID4030109","TextValue"=>"阿梅金那個老頭嘛，我是知道的，呼風喚雨不在話下。"],
14041=>["Value"=>14041,"TextKey"=>"剧情ID4030110","TextValue"=>"再看看你們，只是走到這邊就半死不活了，體能訓練怎麼能落下？"],
14042=>["Value"=>14042,"TextKey"=>"剧情ID4030111","TextValue"=>"嗯，恩達的確需要鍛煉。"],
14043=>["Value"=>14043,"TextKey"=>"剧情ID4030112","TextValue"=>"閉嘴！"],
14044=>["Value"=>14044,"TextKey"=>"剧情ID4030113","TextValue"=>"根據我媽的預言，我們只會迎來更大的風暴……"],
14045=>["Value"=>14045,"TextKey"=>"剧情ID4030114","TextValue"=>"莫洛斯的預言嗎……"],
14046=>["Value"=>14046,"TextKey"=>"剧情ID4030115","TextValue"=>"年輕人們！"],
14047=>["Value"=>14047,"TextKey"=>"剧情ID4030116","TextValue"=>"明白！"],
14048=>["Value"=>14048,"TextKey"=>"剧情ID4040101","TextValue"=>"看北方那塊高地！居然有天然的階梯。"],
14049=>["Value"=>14049,"TextKey"=>"剧情ID4040102","TextValue"=>"是的，長官！"],
14050=>["Value"=>14050,"TextKey"=>"剧情ID4040103","TextValue"=>"你們有沒有注意到中間的圓柱？那一定不是天然形成的。"],
14051=>["Value"=>14051,"TextKey"=>"剧情ID4040104","TextValue"=>"這樣的高度和形狀，賭上我祭司世家的名譽，這以前一定是一個祭壇！"],
14052=>["Value"=>14052,"TextKey"=>"剧情ID4040105","TextValue"=>"這個祭壇看上去很荒涼。"],
14053=>["Value"=>14053,"TextKey"=>"剧情ID4040106","TextValue"=>"沒錯，年頭一定很久遠了。"],
14054=>["Value"=>14054,"TextKey"=>"剧情ID4040107","TextValue"=>"這樣的祭壇，無法與大德魯伊的力量產生共鳴，可是找不到阿梅金的。"],
14055=>["Value"=>14055,"TextKey"=>"剧情ID4040108","TextValue"=>"酋長，我們需要能夠凝聚能量的裝置……"],
14056=>["Value"=>14056,"TextKey"=>"剧情ID4040109","TextValue"=>"材料一定要耐得住這裡的溫度，形狀要聚攏……"],
14057=>["Value"=>14057,"TextKey"=>"剧情ID4040110","TextValue"=>"岩漿裡那些奇怪的尖牙怎麼樣？"],
14058=>["Value"=>14058,"TextKey"=>"剧情ID4040111","TextValue"=>"很不錯！阿蘭，怪不得臨行前女神的提示說，要與重要的夥伴同行！"],
14059=>["Value"=>14059,"TextKey"=>"剧情ID4040112","TextValue"=>"的確如此。感謝女神！"],
14060=>["Value"=>14060,"TextKey"=>"剧情ID4040113","TextValue"=>"閉嘴！不包括你！"],
14061=>["Value"=>14061,"TextKey"=>"剧情ID4040114","TextValue"=>"材料交給我們了不起的酋長吧！"],
14062=>["Value"=>14062,"TextKey"=>"剧情ID4050101","TextValue"=>"酋長，我們的進度十分喜人。"],
14063=>["Value"=>14063,"TextKey"=>"剧情ID4050102","TextValue"=>"祭壇使用起來應該沒有問題！"],
14064=>["Value"=>14064,"TextKey"=>"剧情ID4050103","TextValue"=>"但，看看現在幽暗的天色，恩達上下祭壇實在太艱難了，萬一摔下來怎麼辦？"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4050104","TextValue"=>"不錯，什麼斯坦，看來你也有不那麼討厭的時候。"],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4050105","TextValue"=>"畢竟恩達年紀確實，嗯，不小了……"],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4050106","TextValue"=>"氣死我對你有什麼好處？"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4050107","TextValue"=>"那我們在階梯兩邊修建上火把吧，這很簡單！"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060101","TextValue"=>"這個祭壇……給我的感覺還是缺一些什麼，完全無法感應女神的資訊……"],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4060102","TextValue"=>"但應該可以感應阿梅金！"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4060103","TextValue"=>"好冷……是……是誰？……"],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4060104","TextValue"=>"阿梅金！你在哪裡？"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4060105","TextValue"=>"你……你是恩達？我不知道我在哪裡……但是，這裡好冷……"],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4060106","TextValue"=>"冷？"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4060107","TextValue"=>"看來他不在這裡。"],
14076=>["Value"=>14076,"TextKey"=>"剧情ID4060108","TextValue"=>"我動不了……救命， $#^*,!@%&:?""],
14077=>["Value"=>14077,"TextKey"=>"剧情ID4060109","TextValue"=>"你說什麼？"],
14078=>["Value"=>14078,"TextKey"=>"剧情ID4060110","TextValue"=>"喂，恩達，我想……"],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"……"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4060112","TextValue"=>"阿梅金你先等等！現在我要和另一個人說話，也許能幫到你。"],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4060113","TextValue"=>"特拉齊嘉，你見過這種情況嗎？"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4060114","TextValue"=>"喂……"],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4060115","TextValue"=>"精神溝通不算我的專長。但我媽也遇到過這種情況，應該還是祭壇的原因。"],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4060116","TextValue"=>"祭壇力量還是太過薄弱，缺少了最重要的一環。"],
14085=>["Value"=>14085,"TextKey"=>"剧情ID4060117","TextValue"=>"女神力量……@#$>:%^精粹……"],
14086=>["Value"=>14086,"TextKey"=>"剧情ID4060118","TextValue"=>"酋長，我好像知道了，你看祭壇柱子上的空缺！"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4060119","TextValue"=>"需要補充上精魄，增強祭壇的力量。咱們有嗎？"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4060120","TextValue"=>"你說呢？阿蘭，馬上交給你們了。"],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4060121","TextValue"=>"沒問題！"],
14090=>["Value"=>14090,"TextKey"=>"剧情ID4070101","TextValue"=>"阿梅金，說點什麼！"],
14091=>["Value"=>14091,"TextKey"=>"剧情ID4070102","TextValue"=>"你們需要來尋找我……"],
14092=>["Value"=>14092,"TextKey"=>"剧情ID4070103","TextValue"=>"這次沒問題。你的聲音終於聽上去不像裝咳嗽的麥格了，那個含糊勁兒！"],
14093=>["Value"=>14093,"TextKey"=>"剧情ID4070104","TextValue"=>"麥格還是個老太太。"],
14094=>["Value"=>14094,"TextKey"=>"剧情ID4070105","TextValue"=>"你這麼一說……"],
14095=>["Value"=>14095,"TextKey"=>"剧情ID4070106","TextValue"=>"我曾經也到了火山，但不知發生了什麼，等我清醒過來，就已經到了這裡。我也不知道這是什麼鬼地方。"],
14096=>["Value"=>14096,"TextKey"=>"剧情ID4070107","TextValue"=>"雖然你們的祭壇可以聯繫我，但我猜無法指引你們我在哪裡……"],
14097=>["Value"=>14097,"TextKey"=>"剧情ID4070108","TextValue"=>"因為我可以接收並回應恩達，但這個地方……一定不會。還會想方設法地藏起來。"],
14098=>["Value"=>14098,"TextKey"=>"剧情ID4070109","TextValue"=>"有什麼辦法？"],
14099=>["Value"=>14099,"TextKey"=>"剧情ID4070110","TextValue"=>"要和環境一起共生……生生不息，構成迴圈。"],
14100=>["Value"=>14100,"TextKey"=>"剧情ID4070111","TextValue"=>"什麼意思，讓我們這裡的火，流到你的冰窖那裡？"],
14101=>["Value"=>14101,"TextKey"=>"剧情ID4070112","TextValue"=>"你個頭腦簡單的學渣！當然不是。"],
14102=>["Value"=>14102,"TextKey"=>"剧情ID4070113","TextValue"=>"迴圈……讓岩漿流動，讓飛灰升騰，讓灰燼冷卻，讓石頭再變成岩漿。"],
14103=>["Value"=>14103,"TextKey"=>"剧情ID4070114","TextValue"=>"你的確是個優等生。"],
14104=>["Value"=>14104,"TextKey"=>"剧情ID4070115","TextValue"=>"等著！"],
14105=>["Value"=>14105,"TextKey"=>"剧情ID4080101","TextValue"=>"這是個……豬頭？"],
14106=>["Value"=>14106,"TextKey"=>"剧情ID4080102","TextValue"=>"嗯哼。"],
14107=>["Value"=>14107,"TextKey"=>"剧情ID4080103","TextValue"=>"道理我都懂，但為什麼是豬頭的形狀？"],
14108=>["Value"=>14108,"TextKey"=>"剧情ID4080104","TextValue"=>"你等等，我似乎不該問這個問題。"],
14109=>["Value"=>14109,"TextKey"=>"剧情ID4080105","TextValue"=>"女神在上，成功的路上少不了親愛的夥伴。為什麼不把我的夥伴，什麼斯坦的痕跡，留在這裡呢？"],
14110=>["Value"=>14110,"TextKey"=>"剧情ID4080106","TextValue"=>"我們祭司多可愛啊，看這隱晦的示好方式。"],
14111=>["Value"=>14111,"TextKey"=>"剧情ID4080107","TextValue"=>"你！"],
14112=>["Value"=>14112,"TextKey"=>"剧情ID4080108","TextValue"=>"你們讓開，我和酋長要發動這個祭壇了。"],
14113=>["Value"=>14113,"TextKey"=>"剧情ID4090101","TextValue"=>"呼，恩達，交給你了。"],
14114=>["Value"=>14114,"TextKey"=>"剧情ID4090102","TextValue"=>"阿梅金在……"],
14115=>["Value"=>14115,"TextKey"=>"剧情ID4090103","TextValue"=>"遙遠東方……冰霜禁忌之地。"],
14116=>["Value"=>14116,"TextKey"=>"剧情ID4090104","TextValue"=>"雖然現在熱得冒煙，但我想，我們該準備些禦寒的衣物了。+CC14120:C14141"],
14117=>["Value"=>14117,"TextKey"=>"剧情ID99990101","TextValue"=>"這霧比我建立王國遇到的任何一次危機都詭異！"],
14118=>["Value"=>14118,"TextKey"=>"剧情ID99990102","TextValue"=>"看來我們被困在此處了，這裡有人嗎？"],
14119=>["Value"=>14119,"TextKey"=>"剧情ID99990103","TextValue"=>"沒人？看來我們得自己想辦法驅散這霧了！"],
14120=>["Value"=>14120,"TextKey"=>"剧情ID47990201","TextValue"=>"嘿，幹得好！這些小麥出現在這裡，肯定有它的用處！"],
14121=>["Value"=>14121,"TextKey"=>"剧情ID99990202","TextValue"=>"先採摘一些，看看能做什麼吧！"],
14122=>["Value"=>14122,"TextKey"=>"剧情ID99990301","TextValue"=>"誒！一本魔法書！吃掉麵包後，它就突然冒出來了。"],
14123=>["Value"=>14123,"TextKey"=>"剧情ID99990302","TextValue"=>"霧似乎因為魔法書而變淡了些？……也許我們可以用魔法書來清除迷霧。"],
14124=>["Value"=>14124,"TextKey"=>"剧情ID34990101","TextValue"=>"好的！我們有了一個計畫：合併作物，製作食物，獲得魔法書，清除迷霧！"],
14125=>["Value"=>14125,"TextKey"=>"剧情ID99990601","TextValue"=>"啊！這是什麼？好像有個箱子埋在這些碎石下麵。"],
14126=>["Value"=>14126,"TextKey"=>"剧情ID99990602","TextValue"=>"我們快打開它！看看裡面有什麼，我已經迫不及待想把這一切告訴我的朋友們了。"],
14127=>["Value"=>14127,"TextKey"=>"剧情ID99990701","TextValue"=>"看起來我們要在這裡待上一陣兒，可以用這些石頭建一個遮風擋雨的地方。"],
14128=>["Value"=>14128,"TextKey"=>"剧情ID99990702","TextValue"=>"我們成功了！果然，這些魔法書的魔力很管用！"],
14129=>["Value"=>14129,"TextKey"=>"剧情ID99991001","TextValue"=>"我很好奇一次合併5個相同物品會發生什麼？"],
14130=>["Value"=>14130,"TextKey"=>"剧情ID99991002","TextValue"=>"我覺得應該把它們合起來試試，似乎會有好事情發生。"],
14131=>["Value"=>14131,"TextKey"=>"剧情ID99990801","TextValue"=>"這是什麼？"],
14132=>["Value"=>14132,"TextKey"=>"剧情ID99990802","TextValue"=>"現在這裡還是一片廢墟，不過只要花點時間，我們就能用這些石頭建造出一座基地！"],
14133=>["Value"=>14133,"TextKey"=>"剧情ID99990803","TextValue"=>"說得對，我們的當務之急，是建造一個堅實的堡壘，對抗未知的麻煩。"],
14134=>["Value"=>14134,"TextKey"=>"剧情ID99990501","TextValue"=>"這帽子似乎有著微弱的魔力。"],
14135=>["Value"=>14135,"TextKey"=>"剧情ID99990502","TextValue"=>"繼續合成！我想這是個線索，能夠找到助我們一臂之力的人。"],
14136=>["Value"=>14136,"TextKey"=>"剧情ID99990901","TextValue"=>"這四個神奇的底座是什麼？看上去似乎需要什麼物品來啟動它們。"],
14137=>["Value"=>14137,"TextKey"=>"剧情ID99990902","TextValue"=>"尊敬的陛下，這是修建城堡做需要的底座。只要我們修建好了相應的房子，放在上面，就可以很輕鬆地修建城堡了。"],
14138=>["Value"=>14138,"TextKey"=>"剧情ID99990903","TextValue"=>"等到我們完成的時候，我們會提醒您，請您親自在上面放置。"],
14139=>["Value"=>14139,"TextKey"=>"剧情ID99991101","TextValue"=>"我迫不及待想要找找裡面藏著什麼神秘的寶藏了。"],
14140=>["Value"=>14140,"TextKey"=>"剧情ID99991102","TextValue"=>"我們可以用它們合成可以開採的石頭資源！這樣我們就有取之不盡的石塊了！"],
14141=>["Value"=>14141,"TextKey"=>"剧情ID99991201","TextValue"=>"非常有用的魔法水晶！可以代替任何一件你需要的物品！"],
14142=>["Value"=>14142,"TextKey"=>"剧情ID99991202","TextValue"=>"使用它，你只要2個，而不是3個相同物品就能合併！試著用起來吧！"],
14143=>["Value"=>14143,"TextKey"=>"剧情ID99991203","TextValue"=>"記住，魔法水晶能代替任何一件你需要的物品！"],
14144=>["Value"=>14144,"TextKey"=>"剧情ID30400301","TextValue"=>"看看這可愛的小石架！"],
14145=>["Value"=>14145,"TextKey"=>"剧情ID30400302","TextValue"=>"這和我最好的作品相比，實在相差太遠了。來吧，瓦特，我們還需要更多的石塊。"],
14146=>["Value"=>14146,"TextKey"=>"剧情ID30400401","TextValue"=>"不錯嘛！利用磚塊把門都做了出來。"],
14147=>["Value"=>14147,"TextKey"=>"剧情ID30400402","TextValue"=>"感謝您的讚賞。您再給一些時間，我們還可以做出更好的。"],
14148=>["Value"=>14148,"TextKey"=>"剧情ID30400501","TextValue"=>"你們的確是優秀的石匠！"],
14149=>["Value"=>14149,"TextKey"=>"剧情ID30400601","TextValue"=>"我和瓦裡將石屋增大了許多。不得不說，這段時間的努力是有效果的。"],
14150=>["Value"=>14150,"TextKey"=>"剧情ID30400602","TextValue"=>"的確如此！我想，接下來我需要一個高點，用來瞭望遠方。"],
14151=>["Value"=>14151,"TextKey"=>"剧情ID30400701","TextValue"=>"現在只要把那些再多建四個，就能擁有自己的一處堡壘了！"],
14152=>["Value"=>14152,"TextKey"=>"剧情ID30400801","TextValue"=>"城堡建成了，我們可以把它當成工具箱來使用！"],
14153=>["Value"=>14153,"TextKey"=>"剧情ID30400802","TextValue"=>"沒錯，能在裡面找到好多有用的東西！"],
14154=>["Value"=>14154,"TextKey"=>"剧情ID31610301","TextValue"=>"帽子的魔力大漲！我們有必要找到它的主人，一定是位強大的巫師。"],
14155=>["Value"=>14155,"TextKey"=>"剧情ID31610401","TextValue"=>"嗯？竟然是一隻兔子！"],
14156=>["Value"=>14156,"TextKey"=>"剧情ID31610402","TextValue"=>"哈哈哈，對，若是有新鮮水嫩的胡蘿蔔，可不要忘了默念我的名字哦。吾名莫瑞斯。"],
14157=>["Value"=>14157,"TextKey"=>"剧情ID31610403","TextValue"=>"莫瑞斯，看來你註定要加入我的麾下了！若是論對甜蜜的美味瞭解，整個希爾王國都難有能與我相提並論的！"],
14158=>["Value"=>14158,"TextKey"=>"剧情ID30410301","TextValue"=>"我們有木材，可以建造一些住起來更舒適的地方。"],
14159=>["Value"=>14159,"TextKey"=>"剧情ID30410302","TextValue"=>"不錯，這一次我們可以慢慢來。距離寒冷的季節還有些時候。"],
14160=>["Value"=>14160,"TextKey"=>"剧情ID30410401","TextValue"=>"可算是有個房頂了。"],
14161=>["Value"=>14161,"TextKey"=>"剧情ID30410402","TextValue"=>"繼續！我的壁爐可還缺一個煙囪。"],
14162=>["Value"=>14162,"TextKey"=>"剧情ID30410501","TextValue"=>"為什麼不做個可愛的閣樓呢，胡蘿蔔好好保存，可是冬季最好的食物。"],
14163=>["Value"=>14163,"TextKey"=>"剧情ID30410502","TextValue"=>"哈哈，莫瑞斯，對你來說，春夏秋季最好的食物不也是胡蘿蔔？"],
14164=>["Value"=>14164,"TextKey"=>"剧情ID30410601","TextValue"=>"我想我還需要一些更大的面積，安置我那些可愛的魔力小物件兒。"],
14165=>["Value"=>14165,"TextKey"=>"剧情ID30410602","TextValue"=>"我設計的完美木材結構，完全可以撐起更大的房子。"],
14166=>["Value"=>14166,"TextKey"=>"剧情ID30410701","TextValue"=>"好漂亮的小屋！瓦特、瓦裡，沒想到你們加工木材的手藝同樣出色！"],
14167=>["Value"=>14167,"TextKey"=>"剧情ID30410801","TextValue"=>"沒想到不需要魔力，也能建造出這樣出色的建築！"],
14168=>["Value"=>14168,"TextKey"=>"剧情ID30410802","TextValue"=>"哈哈哈哈，我這個弟弟，最擅長建築設計。我嘛，最擅長給他加油。"],
14169=>["Value"=>14169,"TextKey"=>"剧情ID30410803","TextValue"=>"不用理瓦特，我們要加緊進度了。"],
14170=>["Value"=>14170,"TextKey"=>"剧情ID30410901","TextValue"=>"熱騰騰的城堡出爐咯！"],
14171=>["Value"=>14171,"TextKey"=>"剧情ID30410902","TextValue"=>"一個冬暖夏涼的地方！冬日裡，備些熱騰騰的下午茶甜點。"],
14172=>["Value"=>14172,"TextKey"=>"剧情ID30410903","TextValue"=>"可以做胡蘿蔔味道的小甜餅和麵包。"],
14173=>["Value"=>14173,"TextKey"=>"剧情ID31620301","TextValue"=>"莫瑞斯，誰會需要這麼多琴？"],
14174=>["Value"=>14174,"TextKey"=>"剧情ID31620302","TextValue"=>"哈哈，我可想不到是誰，但這個人的琴聲一定不錯！"],
14175=>["Value"=>14175,"TextKey"=>"剧情ID31620401","TextValue"=>"我感受到這些琴的力量逐漸在增長。"],
14176=>["Value"=>14176,"TextKey"=>"剧情ID31620501","TextValue"=>"這些琴，是一個樂者最好的武器！所以還能繼續升級嗎？"],
14177=>["Value"=>14177,"TextKey"=>"剧情ID31620601","TextValue"=>"我幾乎能想像到這樣的豎琴佇立在皇室豪華的音樂廳中的樣子了。"],
14178=>["Value"=>14178,"TextKey"=>"剧情ID31620602","TextValue"=>"我想，這琴的主人會有這樣的機會的。"],
14179=>["Value"=>14179,"TextKey"=>"剧情ID31620701","TextValue"=>"在下名為蘭博。我又多了一件可以唱成頌歌的事情！"],
14180=>["Value"=>14180,"TextKey"=>"剧情ID31620702","TextValue"=>"唔，若是有一份霜淇淋松餅，再配上蘭博你的樂聲，那簡直是最好的組合了！簡直比搭配肉桂粉都好！"],
14181=>["Value"=>14181,"TextKey"=>"剧情ID31620703","TextValue"=>"在圓弧的大廳裡，在田野的輕風中，在讚歌所贈之人面前。"],
14182=>["Value"=>14182,"TextKey"=>"剧情ID30420401","TextValue"=>"我喜歡這個精巧的門。我想，海上或許需要一個風向標？"],
14183=>["Value"=>14183,"TextKey"=>"剧情ID30420501","TextValue"=>"這不禁讓我想起了以前冒險的日子啊。聽我的，我們需要加高一下底座，要知道，海浪的拍打可不是鬧著玩的。"],
14184=>["Value"=>14184,"TextKey"=>"剧情ID30420601","TextValue"=>"真不錯，瓦裡你是個毋庸置疑的天才！"],
14185=>["Value"=>14185,"TextKey"=>"剧情ID30420602","TextValue"=>"哈哈哈，瓦裡一向是最好的！而且，以我對他的瞭解，這還遠遠不到歡呼慶祝的時候。"],
14186=>["Value"=>14186,"TextKey"=>"剧情ID30420701","TextValue"=>"讚美這高超的技藝！我們還需要什麼呢……黑暗的夜晚，我們需要美妙的光亮，成為旅人的燈塔。"],
14187=>["Value"=>14187,"TextKey"=>"剧情ID30420801","TextValue"=>"這樣美妙的船屋，只要再準備幾個，我們的遊輪就可以揚帆起航了！"],
14188=>["Value"=>14188,"TextKey"=>"剧情ID30420901","TextValue"=>"我已經聽到了海浪的拍打聲，嗅到了風暴前夕的味道。真是令人期待！"],
14189=>["Value"=>14189,"TextKey"=>"剧情ID30420902","TextValue"=>"哈哈，蘭博已經沉浸在探險生活的暢想中了。瓦特、瓦裡，你們果然是最好的匠人！"],
14190=>["Value"=>14190,"TextKey"=>"剧情ID30420903","TextValue"=>"感謝陛下的賞識！有了這座遊船城堡，也意味著我們實力大增！"],
14191=>["Value"=>14191,"TextKey"=>"剧情ID31630301","TextValue"=>"鼓身長了，終於像是大人用的了！我想自己敲鼓試試，哈哈！"],
14192=>["Value"=>14192,"TextKey"=>"剧情ID31630401","TextValue"=>"要我說，鼓身還需要一個固定帶，便於保護鼓面。"],
14193=>["Value"=>14193,"TextKey"=>"剧情ID31630501","TextValue"=>"加固一下支架如何？蘭博最清楚，他們這種人，一演奏起來可能會忘乎所以。弄壞了就不好了。"],
14194=>["Value"=>14194,"TextKey"=>"剧情ID31630502","TextValue"=>"的確如此。我送走了1,2,3,4……不少把豎琴呢。"],
14195=>["Value"=>14195,"TextKey"=>"剧情ID31630601","TextValue"=>"羽毛裝飾的確十分可愛，還很有特色。蘭博，你覺得呢？"],
14196=>["Value"=>14196,"TextKey"=>"剧情ID31630602","TextValue"=>"不過演奏起來可能會礙事，還是改動一下裝飾位置比較好。"],
14197=>["Value"=>14197,"TextKey"=>"剧情ID31630701","TextValue"=>"這次肯定不會妨礙敲鼓了。"],
14198=>["Value"=>14198,"TextKey"=>"剧情ID31630702","TextValue"=>"但減弱了原來那種古樸又精巧的美感。蘭博，你看這還有改進空間嗎？"],
14199=>["Value"=>14199,"TextKey"=>"剧情ID31630801","TextValue"=>"是你們找到了我的樂鼓嗎？謝謝你們！"],
14200=>["Value"=>14200,"TextKey"=>"剧情ID31630802","TextValue"=>"好可愛的小姑娘！"],
14201=>["Value"=>14201,"TextKey"=>"剧情ID31630803","TextValue"=>"嘻嘻，謝謝。我叫美樂蒂，可以叫我小美哦。我也不知道為什麼，醒來就發現自己在這場迷霧中了。"],
14202=>["Value"=>14202,"TextKey"=>"剧情ID31630804","TextValue"=>"大家都是如此。小美，很高興你加入我們一起探索！"],
14203=>["Value"=>14203,"TextKey"=>"剧情ID30430301","TextValue"=>"美麗的大珍珠，這正是我想要的樣子呀！哈哈，雖然不能居住啦。"],
14204=>["Value"=>14204,"TextKey"=>"剧情ID30430302","TextValue"=>"我就想你一定喜歡！不過，小美，接下來我們就得做屋子了哦。"],
14205=>["Value"=>14205,"TextKey"=>"剧情ID30430401","TextValue"=>"瓦裡很有創意嘛！貝殼做房頂，美麗歸美麗，會不會太脆弱了？"],
14206=>["Value"=>14206,"TextKey"=>"剧情ID30430501","TextValue"=>"親愛的瓦特、瓦裡，可以把房子再擴大些嗎？我想擴充更大空間放置珍珠和海貝。"],
14207=>["Value"=>14207,"TextKey"=>"剧情ID30430502","TextValue"=>"稍等。"],
14208=>["Value"=>14208,"TextKey"=>"剧情ID30430601","TextValue"=>"用海藻加些裝飾怎麼樣？"],
14209=>["Value"=>14209,"TextKey"=>"剧情ID30430701","TextValue"=>"太美啦！嘻嘻，我好開心啊，看到珍珠屋就忍不住笑！"],
14210=>["Value"=>14210,"TextKey"=>"剧情ID30430702","TextValue"=>"哈哈哈，小美，你可以再等一會！我偷偷拿到了瓦裡接下來的設計圖……"],
14211=>["Value"=>14211,"TextKey"=>"剧情ID30430801","TextValue"=>"天哪，還多了兩座尖頂高塔！這是即便在我最奢侈的夢裡也沒有出現過的場景！"],
14212=>["Value"=>14212,"TextKey"=>"剧情ID30430802","TextValue"=>"只要有四棟這樣的豪宅，頂級的城堡指日可待。"],
14213=>["Value"=>14213,"TextKey"=>"剧情ID30430901","TextValue"=>"怎麼樣，不錯吧，我就看小美很喜歡尖頂的樣子。"],
14214=>["Value"=>14214,"TextKey"=>"剧情ID30430902","TextValue"=>"我可以進去嗎？那我進去啦？哈哈，我的鼓呢，我好想敲鼓！"],
14215=>["Value"=>14215,"TextKey"=>"剧情ID30430903","TextValue"=>"我來為你伴奏，小美。"],
14216=>["Value"=>14216,"TextKey"=>"剧情ID31640301","TextValue"=>"這個王冠原本的主人一定是個位高權重之人。尊貴的陛下，您沒有什麼印象嗎？"],
14217=>["Value"=>14217,"TextKey"=>"剧情ID31640302","TextValue"=>"不太清楚，沒有我們家族的印記。這樣我也想不出是屬於誰的了。"],
14218=>["Value"=>14218,"TextKey"=>"剧情ID31640401","TextValue"=>"華美的金子，精緻的冠冕，作為詩歌的意象，它們與權柄如此相稱。"],
14219=>["Value"=>14219,"TextKey"=>"剧情ID31640501","TextValue"=>"加上了綠寶石，哈哈，很符合我的王后的審美！"],
14220=>["Value"=>14220,"TextKey"=>"剧情ID31640601","TextValue"=>"如此華貴的王冠，莫瑞斯剛剛居然告訴我這還不是頂級！"],
14221=>["Value"=>14221,"TextKey"=>"剧情ID31640602","TextValue"=>"對，我可以感受到上面附著的魔力，還遠遠沒有達到上限。"],
14222=>["Value"=>14222,"TextKey"=>"剧情ID31640701","TextValue"=>"等王冠的主人來了，不知道我能不能借著戴一戴呢，這實在是太漂亮啦。"],
14223=>["Value"=>14223,"TextKey"=>"剧情ID31640801","TextValue"=>"魔力湧動得十分劇烈，它的主人很快就會降臨了！"],
14224=>["Value"=>14224,"TextKey"=>"剧情ID31640901","TextValue"=>"嘿，希爾，居然是你這個老傢伙。"],
14225=>["Value"=>14225,"TextKey"=>"剧情ID31640902","TextValue"=>"難以置信！我一直沒想到你也困在這裡了。嘿，各位，這是獅王辛巴。"],
14226=>["Value"=>14226,"TextKey"=>"剧情ID31640903","TextValue"=>"這裡的環境我已經有了初步的判斷。我想，繼續修建領地刻不容緩。"],
14227=>["Value"=>14227,"TextKey"=>"剧情ID30440301","TextValue"=>"這個簡陋的馬車可很難遮風擋雨。"],
14228=>["Value"=>14228,"TextKey"=>"剧情ID30440302","TextValue"=>"獅王陛下，的確如此。我們還需要一些時間。"],
14229=>["Value"=>14229,"TextKey"=>"剧情ID30440401","TextValue"=>"雖然還很簡單，但是已經有了加工的雛形。"],
14230=>["Value"=>14230,"TextKey"=>"剧情ID30440402","TextValue"=>"給車夫改良下座椅吧，長途趕路可是很不容易的。"],
14231=>["Value"=>14231,"TextKey"=>"剧情ID30440501","TextValue"=>"很好，車裡的座位同樣需要改進，瓦特、瓦裡，麻煩你們了。"],
14232=>["Value"=>14232,"TextKey"=>"剧情ID30440601","TextValue"=>"舒適度大大提升！要我說，試試密閉型車廂如何？隱私和安全兼顧。辛巴，我是看在咱們上次合作的份上才推薦的！"],
14233=>["Value"=>14233,"TextKey"=>"剧情ID30440701","TextValue"=>"果然很不錯！瓦特、瓦裡，早就聽說你們技藝精湛！可惜我的子民只有毛爪子，這種精細活兒，根本就是在難為獅子！"],
14234=>["Value"=>14234,"TextKey"=>"剧情ID30440702","TextValue"=>"哈哈哈哈，謝謝獅王陛下的讚賞！改進還沒完成呢，您可以期待一下。"],
14235=>["Value"=>14235,"TextKey"=>"剧情ID30440801","TextValue"=>"瓦裡，再增高一層能做到嗎？魔力的迴圈需要一定的高度。"],
14236=>["Value"=>14236,"TextKey"=>"剧情ID30440802","TextValue"=>"可以，挑高設計是瓦特的專長。"],
14237=>["Value"=>14237,"TextKey"=>"剧情ID30440901","TextValue"=>"瓦特、瓦裡，以後隨我去我的王國如何？保證比待在希爾王國的待遇更加優厚。"],
14238=>["Value"=>14238,"TextKey"=>"剧情ID30440902","TextValue"=>"辛巴，我還在這裡呢！我以為你至少會避著我挖我的牆角？"],
14239=>["Value"=>14239,"TextKey"=>"剧情ID30441001","TextValue"=>"對我來說，這座大型城堡最大的意義是可以舒適隨意地去任何地方。"],
14240=>["Value"=>14240,"TextKey"=>"剧情ID30441002","TextValue"=>"辛巴一直在草原上馳騁，果然就連住的城堡也不能安安定定地待在那兒。"],
14241=>["Value"=>14241,"TextKey"=>"剧情ID30441003","TextValue"=>"瓦特、瓦裡，關於請務必認真考慮我之前的提議。"],
14242=>["Value"=>14242,"TextKey"=>"剧情ID31650301","TextValue"=>"哇哦，愈發豐盛啦！不過這個分量對我來說太小啦。"],
14243=>["Value"=>14243,"TextKey"=>"剧情ID31650401","TextValue"=>"餐桌和食物上的魔力正在逐漸充盈。"],
14244=>["Value"=>14244,"TextKey"=>"剧情ID31650501","TextValue"=>"我還是喜歡吃肉，正好希爾喜歡甜點，我們井水不犯河水。"],
14245=>["Value"=>14245,"TextKey"=>"剧情ID31650601","TextValue"=>"不禁讓我懷念起了以前舉辦宴會的日子。我們現在雖然人數少了點，但也可以準備準備，一起吃大餐！"],
14246=>["Value"=>14246,"TextKey"=>"剧情ID31650701","TextValue"=>"這是美好夜晚的意象。"],
14247=>["Value"=>14247,"TextKey"=>"剧情ID31650801","TextValue"=>"魔力幾乎到達了頂峰，我們很快可以見到這些美麗幻覺的主人了。"],
14248=>["Value"=>14248,"TextKey"=>"剧情ID31650901","TextValue"=>"……"],
14249=>["Value"=>14249,"TextKey"=>"剧情ID31650902","TextValue"=>"你好啊，可愛的小姑娘。你叫什麼名字？"],
14250=>["Value"=>14250,"TextKey"=>"剧情ID31650903","TextValue"=>"我……我沒有名字。或許，也許，你可以叫我火柴。"],
14251=>["Value"=>14251,"TextKey"=>"剧情ID31650904","TextValue"=>"好的。孩子，別怕，快來我們的城堡裡取個暖吧。"],
14252=>["Value"=>14252,"TextKey"=>"剧情ID30450301","TextValue"=>"怎麼樣，小火柴，這個火柴盒是不是你想要的樣子？"],
14253=>["Value"=>14253,"TextKey"=>"剧情ID30450302","TextValue"=>"對，對的。我只要蜷縮起來，就可以躺進裡面了，很擋風的。"],
14254=>["Value"=>14254,"TextKey"=>"剧情ID30450401","TextValue"=>"謝謝你，瓦特。沒有想到，我也擁有房梁啦。真好！"],
14255=>["Value"=>14255,"TextKey"=>"剧情ID30450501","TextValue"=>"我可以在屋子裡面站起來了，而不僅僅是躺著。"],
14256=>["Value"=>14256,"TextKey"=>"剧情ID30450601","TextValue"=>"小火柴，我想這個擋風簾你一定會喜歡。"],
14257=>["Value"=>14257,"TextKey"=>"剧情ID30450602","TextValue"=>"真的！我可以少點一些火柴來取暖啦。"],
14258=>["Value"=>14258,"TextKey"=>"剧情ID30450701","TextValue"=>"嘿嘿，我最擅長的挑高設計！"],
14259=>["Value"=>14259,"TextKey"=>"剧情ID30450702","TextValue"=>"謝謝！這是我見過最漂亮的房子……以前街上的大商人的房子，也沒有這麼漂亮。"],
14260=>["Value"=>14260,"TextKey"=>"剧情ID30450801","TextValue"=>"如果只能對房屋提一個要求，那你的要求是什麼呢？"],
14261=>["Value"=>14261,"TextKey"=>"剧情ID30450802","TextValue"=>"啊……有房屋已經很好啦，我沒有什麼要求。"],
14262=>["Value"=>14262,"TextKey"=>"剧情ID30450803","TextValue"=>"不可以哦，小火柴！再努力想一想！一定有什麼地方的，加油再思考一下。"],
14263=>["Value"=>14263,"TextKey"=>"剧情ID30450804","TextValue"=>"嗯……我想，是暖和。一定要暖和。"],
14264=>["Value"=>14264,"TextKey"=>"剧情ID30450901","TextValue"=>"只要有四棟這樣的豪宅，小火柴也可以擁有自己的城堡了。是只屬於小火柴的新家。"],
14265=>["Value"=>14265,"TextKey"=>"剧情ID30451001","TextValue"=>"你們說的是真的嗎？……這個美麗的城堡，是我的？"],
14266=>["Value"=>14266,"TextKey"=>"剧情ID30451002","TextValue"=>"當然啦，親愛的孩子。正是由於此處很危險，我們才要更加重視我們的棲身之所啊。"],
14267=>["Value"=>14267,"TextKey"=>"剧情ID30451003","TextValue"=>"嗚嗚嗚……謝謝，謝謝大家。"],
14268=>["Value"=>14268,"TextKey"=>"剧情ID30451004","TextValue"=>"快去休息吧，為未來的挑戰養精蓄銳！"],
14269=>["Value"=>14269,"TextKey"=>"剧情ID31660301","TextValue"=>"加固設計倒是解了燃眉之急。不過，能不能把燈架改良成更簡潔的款式呢？現在有些遮擋視線。"],
14270=>["Value"=>14270,"TextKey"=>"剧情ID31660401","TextValue"=>"不知道來者會是哪位提燈人呢？"],
14271=>["Value"=>14271,"TextKey"=>"剧情ID31660501","TextValue"=>"火焰很閃亮呢，莫瑞斯，是不是和之前比顯著變強了？"],
14272=>["Value"=>14272,"TextKey"=>"剧情ID31660502","TextValue"=>"的確如此，陛下。這就是魔力增強的表現。"],
14273=>["Value"=>14273,"TextKey"=>"剧情ID31660601","TextValue"=>"這是……南瓜？南瓜甜蜜的香氣，和詭異的特性，是最適合做夜曲主題的植物呢。"],
14274=>["Value"=>14274,"TextKey"=>"剧情ID31660701","TextValue"=>"可愛的南瓜燈，可以做一個精緻的小擺件呢。"],
14275=>["Value"=>14275,"TextKey"=>"剧情ID31660702","TextValue"=>"雖然看不出來，但其實它所蘊含的魔力不容小覷哦。"],
14276=>["Value"=>14276,"TextKey"=>"剧情ID31660801","TextValue"=>"你有沒有注意到，南瓜燈的表情愈發生動，動作也很像人的動作？"],
14277=>["Value"=>14277,"TextKey"=>"剧情ID31660802","TextValue"=>"我有預感，這位南瓜朋友很快就會與我們見面了。"],
14278=>["Value"=>14278,"TextKey"=>"剧情ID31660901","TextValue"=>"嘿，你們，準備好參加午夜的驚嚇派對了嗎？"],
14279=>["Value"=>14279,"TextKey"=>"剧情ID31660902","TextValue"=>"小南瓜，不要嚇唬小孩子！話說，你的南瓜頭採摘的時候熟了嗎？甜不甜？"],
14280=>["Value"=>14280,"TextKey"=>"剧情ID31660903","TextValue"=>"嗯……其實南瓜這種食物，裡面有種叫南瓜素的東西，有劇毒的，不能吃。還有，我叫傑克，不叫小南瓜。"],
14281=>["Value"=>14281,"TextKey"=>"剧情ID31660904","TextValue"=>"好吧傑克。你剛剛說，“南瓜這種食物”？"],
14282=>["Value"=>14282,"TextKey"=>"剧情ID31660905","TextValue"=>"……再見國王先生！"],
14283=>["Value"=>14283,"TextKey"=>"剧情ID30460301","TextValue"=>"對我來說稻草就是最禦寒的東西啦。"],
14284=>["Value"=>14284,"TextKey"=>"剧情ID30460401","TextValue"=>"你們想想，有什麼是別人一看到就會嚇一跳的……對了，骷髏！我要在我的屋門口安裝上骷髏！"],
14285=>["Value"=>14285,"TextKey"=>"剧情ID30460501","TextValue"=>"為什麼不在外觀上裝一個南瓜呢？就像我安裝了胡蘿蔔一樣。"],
14286=>["Value"=>14286,"TextKey"=>"剧情ID30460601","TextValue"=>"打個天窗怎麼樣，傑克先生？就是骷髏裝飾只能摘下來了。"],
14287=>["Value"=>14287,"TextKey"=>"剧情ID30460701","TextValue"=>"我很喜歡！但我喜歡更大的南瓜，你們可以幫我嗎？"],
14288=>["Value"=>14288,"TextKey"=>"剧情ID30460702","TextValue"=>"當然。雕刻工作就交給瓦特。"],
14289=>["Value"=>14289,"TextKey"=>"剧情ID30460801","TextValue"=>"哇，好漂亮！咳咳，不，我是說……我是說我還需要一個提燈！對，提燈！"],
14290=>["Value"=>14290,"TextKey"=>"剧情ID30460901","TextValue"=>"這簡直就是傑克的放大版！小傑克住在大傑克裡，哈哈。"],
14291=>["Value"=>14291,"TextKey"=>"剧情ID30461001","TextValue"=>"哇哦，我的南瓜，我的稻草，我的提燈！瓦特、瓦裡，你們簡直是天才！我保證，下次我惡作劇一定繞過你們！"],
14292=>["Value"=>14292,"TextKey"=>"剧情ID30461002","TextValue"=>"繞過我就可以了。請務必不要放過瓦特。"],
